INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(265589, 'ruRU', 'Ходят слухи, что их завезли из Вальдраккена на Драконьих островах. Бронзовый дракон Хроми наверняка что-нибудь знает. Советую проверить сначала там.', 'Ходят слухи, что их завезли из Вальдраккена на Драконьих островах. Бронзовый дракон Хроми наверняка что-нибудь знает. Советую проверить сначала там.', 54630),
(265585, 'ruRU', 'Я могу помочь тебе с гильдейскими и персональными гербовыми накидками.', 'Я могу помочь тебе с гильдейскими и персональными гербовыми накидками.', 54630),
(265538, 'ruRU', '', 'Сделай свой гардероб по-настоящему уникальным!', 54630),
(265517, 'ruRU', 'Воины стихий понесли тяжелые потери во время первой попытки наступления Рашагет. Еще больше бойцов они потеряли при штурме Амирдрассила с Фиракком.\n\nНу, и когда Виранот перешла на другую сторону, многие воины стихий последовали за ней.\n\nОстальные или попали в плен, или разлетелись как осенние листья после поражения Фиракка.\n\n<Малатра Ночной Венец задумчиво замолкает.>\n\nВоины стихий проиграли, но они не уничтожены. Они затаились и ждут нового призыва к бою.\n\nИ не забывай – есть еще одно Воплощение, которое может повести их за собой.', 'Воины стихий понесли тяжелые потери во время первой попытки наступления Рашагет. Еще больше бойцов они потеряли при штурме Амирдрассила с Фиракком.\n\nНу, и когда Виранот перешла на другую сторону, многие воины стихий последовали за ней.\n\nОстальные или попали в плен, или разлетелись как осенние листья после поражения Фиракка.\n\n<Малатра Ночной Венец задумчиво замолкает.>\n\nВоины стихий проиграли, но они не уничтожены. Они затаились и ждут нового призыва к бою.\n\nИ не забывай – есть еще одно Воплощение, которое может повести их за собой.', 54630),
(265512, 'ruRU', 'Мне поручили надзирать за бывшими воинами стихий, пока они искупают свои преступления.', 'Мне поручили надзирать за бывшими воинами стихий, пока они искупают свои преступления.', 54630),
(265404, 'ruRU', 'Где она?', '', 54630),
(264625, 'ruRU', '', 'В прошлом Эредат был столицей Аргуса и родиной эредаров. Но Пылающий Легион захватил его и извратил демонической магией.\n\nТам же, на Аргусе, мы в конце концов победили Легион. В тяжелой битве мы заплатили дорогую цену...', 54630),
(264621, 'ruRU', '', 'Она начинает переходить на личности. Должно быть, я чем-то разозлила эту Предвестницу. Или, по крайней мере... заинтересовала ее. Хм...', 54630),
(264508, 'ruRU', 'Не будем забывать об осторожности.', '', 54630),
(264336, 'ruRU', 'Одну ветку сломать легко, а связку уже не сломаешь. И в войну, и в мирное время нам нельзя забывать о единстве.', '', 54630),
(263954, 'ruRU', 'Доверять им пока рано.\n\nВполне возможно, когда-нибудь они искупят свою вину. И я все же глубоко уважаю главнокомандующего Лотраксиона, несмотря на его прошлые прегрешения.\n\nКающиеся помогали нам на Аргусе, где мы вырывали с корнем заразу Легиона.\n\nНо то была простая битва, а тяжелые еще впереди. Тогда и посмотрим, из песка или камня выстроены их обещания.', '', 54630),
(263952, 'ruRU', 'Какой же долгий путь у нас за плечами.', '', 54630),
(263901, 'ruRU', '', '$n, как закончишь говорить с ними, приходи на пляж, где мы нашли сестру. Буду ждать тебя там.', 54630),
(263900, 'ruRU', '', '$n, как найдется минута, приходи к могиле моей семьи. Я буду ждать тебя там.', 54630),
(263897, 'ruRU', 'Хм... Мой брат погиб, сражаясь с Королет. И как ему теперь обрести покой? Где справедливость?!', '', 54630),
(263880, 'ruRU', 'При жизни я был воздаятелем.\n\nСвет больше не может до меня дотянуться, но я все еще слышу его голос. Он словно музыка проникает за прутья тюремной решетки.\n\nА теперь позволь мне предаться скорби.', '', 54630),
(263879, 'ruRU', 'Мы привели эти души на Тишамаат, чтобы священный обряд помог им сбросить бренные оковы и обрести истинный покой.\n\nНо я никак не думал, что не только живые будут помогать мертвым, но и мертвые живым.\n\nДумаю, теперь и у тех, и у других все изменится к лучшему. И за это стоит благодарить тебя. Спасибо', '', 54630),
(263877, 'ruRU', '', 'Столько лет прошло с тех пор, как я в последний раз слышала простую молитву, а не боевой гимн.\n\nМне сразу вспомнились... тихие времена.', 54630),
(263871, 'ruRU', '', 'Я благодарна Свету за то, что обрела новый смысл жизни как Страж Тира. Но все же мне приятно вернуться к своему народу.', 54630),
(263781, 'ruRU', '', 'Добро пожаловать в Беланаар! Чувствуй себя здесь как дома.', 54630),
(263780, 'ruRU', 'Когда старина Дубовый Коготь пригласил меня в свою команду на \"Лунной розе\", я... даже хотел согласиться. Паром Оперенной Луны был смыслом моей жизни долгие годы. \n\nНо увидев великолепие Амирдрассила, я осознал, что уделял недостаточно внимания новым чудесам мира. А вот моей команде не терпелось пуститься в новое плавание. Мои ребята верно послужат \"Лунной розе\".\n\nНу а я? Я ухожу на заслуженный отдых. Хочу как следует изучить эти острова, прежде чем окончательно здесь осяду.', '', 54630),
(263770, 'ruRU', 'Приветствую. Я Талар Дубовый Коготь.\n\nПрошло много лет с моего первого путешествия в Гилнеас. Тогда оба наших народа переживали совсем другие времена. Весь мир изменился.\n\nКто бы мог подумать, что после всех страданий, которые выпали на долю калдорай и жителей Гилнеаса, мы сможем повторить это странствие без тревоги, а с чувством... безмятежности.\n\n<Талар глубоко вздыхает и улыбается.>\n\nДобро пожаловать на \"Лунную розу\".', '', 54630),
(263505, 'ruRU', '', 'Не знаю, о чем вы говорили с Малфурионом, но спасибо за попытку его переубедить, $n.\n\n<Келестра утирает слезы.>\n\nРаз мою сестру не хотят пускать к Амирдрассилу, я похороню ее здесь, где мы с тобой отыскали тело.\n\nЯ знаю, она предала наш народ... но теперь она мертва. Неужто ее будут наказывать целую вечность? Почему они упиваются своим гневом? Своей ненавистью? \n\n<Келестра с такой яростью сжимает кулаки, что с ее пальцев капает кровь.>', 54630),
(263502, 'ruRU', '', '$n, спасибо тебе за помощь.\n\nНе спорю, Королет делала ужасные вещи и принесла много горя. Но лично я никогда не знала воина стихий Королет.\n\nА знала друида Королет, и она посвятила свою жизнь поддержанию равновесия и гармонии природы.\n\nЯ знала калдорай Королет, которая отдала бы жизнь, чтобы защитить Тельдрассил и всех его обитателей.\n\nЗнала свою сестру, которая водила меня в доки Рут\'терана смотреть, как приходят и уходят корабли. А по пути домой покупала мне корзинку тундровых ягод, чтобы было чем перекусить в дороге.\n\nВот какую Королет я знала.', 54630),
(263425, 'ruRU', '', 'Черное Копье уже достаточно пострадало. Я с этим покончу!\n\nИдол в середине – самый мощный. Нам нужна сила. Хватит играть в игры.', 54630),
(263423, 'ruRU', '', 'Я уже ношу маску. Она сделана из кости, а не из дерева, но тоже действует. \n\nМастер Гадрин выбрал для ваших руш\'ек древесину из Тернистой долины, чтобы уважить Кево йа Сити и Луку. Перья тоже священны. Наши ящеры носят их и по сей день. Это хорошие руш\'ки.\n\nНо нельзя забывать лоа смерти. Его сила велика, а гнев ужасен. Я сделала свою маску из костей в его честь. И переделывать не буду.', 54630),
(263373, 'ruRU', '', 'Здесь, на этой земле, живут не только эредары.\n\nЯ рада, что мы сумели сохранить дружбу с соседями.', 54630),
(263372, 'ruRU', 'Ах да, я говорил с ним до того, как вы отправились на остров Кровавой Дымки.\n\nОн прямо высказывает все, что у него на уме, и не терпит неуважения. Это было необычно. Мне понравилось с ним общаться.\n\nЕсли мы с ним объединим усилия, то, уверен, мы заставим пророка сдержать обещания.\n\nНовый город должен стать домом для всех. В том числе и для крокулов.', '', 54630),
(263370, 'ruRU', 'Верность демонов – вещь ненадежная. И порой это может принести пользу.\n\nЯ знавал демонов, которые служили иллидари и сражались со своими бывшими хозяевами из Легиона. Не удивлюсь, если некоторые ман\'ари тоже вдруг решат укусить руку, которая их кормит.\n\nСледи за ними в оба глаза.', '', 54630),
(263369, 'ruRU', 'Я уважаю всякого, кто омыл свои руки демонической кровью.\n\nМы с Хатууном знаем, каково это – жить на пепелище собственного дома. Смотреть, как его оскверняют, уничтожают, а ты ничего не можешь сделать. Такое не забывается.\n\nМы позаботимся о том, чтобы такое больше никогда не повторилось.', '', 54630),
(263366, 'ruRU', 'На Аргусе Хатуун был моим главным советником. Он всегда предлагал смелые, бескомпромиссные решения.\n\nВ нем не было подобострастия, которое я замечал в других. Он не боялся оскорбить меня или перейти границы. Мне не хватало этой прямоты.\n\nОн был таким же сильным лидером, как и я. Быть может, когда-нибудь он к нам вернется.', '', 54630),
(263365, 'ruRU', 'Долгие годы я видел два Аргуса одновременно: настоящий Аргус и тот, каким он был когда-то. Но если я присматривался, если чересчур погружался в видение, оно тут же от меня ускользало.\n\nА теперь Велен просит, чтобы я стал прежним. Чтобы мы оба вернулись к истокам.\n\n<Хатуун плотнее скрещивает руки на груди.>\n\nМне... надо подумать.', '', 54630),
(263364, 'ruRU', 'Я... не обрадовался, когда узнал, что есть крокулы, которые живут не на Аргусе, а на каком-то Дреноре, о котором говорил Нобундо.\n\nИ еще я нисколько не удивлен, что Велен не обращал на них никакого внимания все эти годы и не защищал. А обещал, что будет защищать.\n\nХотя... то, что их пригласили на Тишамаат... это уже неплохо. Хоть что-то он сделал, а не пообещал впустую.', '', 54630),
(263362, 'ruRU', 'Было непросто, но я посетил каждое поселение Заблудших в Дреноре, какое только смог найти, и рассказал им о Тишамаате. Меня никто об этом не просил, но мне показалось, что они должны знать. Что это важно.\n\nЯ провел много лет, размышляя над тем, что чувствую к крокулам и Заблудшим.\n\nПризнаться, я их боялся. Не так, как боятся диких зверей, но так, как боятся океана.\n\nМне под водой не место, в глубинах меня ждет одна лишь смерть и темнота. Вот почему я хотел вывести на свет всех, кто там обитает, – и забыл, что рыбе хорошо и на дне. Это ее дом.\n\nМы – один народ, но жить мы можем по-разному.', '', 54630),
(263361, 'ruRU', 'С нами обращались, как с чужаками, вот мы и решили стать чужаками. Мы приняли отверженность и одиночество и стали сильнее.\n\nЕсли бы анахореты Телредора уважали нашу силу, видели в нас равных, то, возможно, мы бы с ними уже давно поговорили. Но они смотрели на нас, как на заблудших талбуков, которых надо вернуть в стадо.\n\nЯ долго думал и решил, что всему виной невежество, а не злой умысел. Они сотни лет вели отшельнический образ жизни. Сказать, что они не умеют общаться, это ничего не сказать.\n\nНе люблю наступать дважды на хвост одной и той же змее, но раз меня пригласили как равного, я их выслушаю.', '', 54630),
(263279, 'ruRU', '', 'Я никогда прежде не бывала в обителях. Сестра рассказывала, что друиды здесь не просто спят и встречаются друг с другом. Их тут еще и хоронят. Она говорила, ближайшие родственники друидов тоже могут здесь упокоиться. \n\nСестре нравился этот обычай. Надеюсь, я помогу родным обрести заслуженный покой.', 54630),
(263272, 'ruRU', '', 'Когда я достигну совершеннолетия, пройду испытания и стану настоящим шаманом! Так говорит Нобундо.', 54630),
(263271, 'ruRU', 'Спасибо за помощь! Эти духи попали на Тишамаат только благодаря тебе, $n.\n\nСамое сложное для аукенайцев – понять, что ты не можешь спасти каждую душу.\n\nНо кого-то все-таки можешь... и это дорогого стоит.', '', 54630),
(263270, 'ruRU', 'Вижу, $n, ты теперь сильнее, чем я мог себе представить.\n\nЯ горжусь тобой.', '', 54630),
(263269, 'ruRU', 'Рад видеть, что ты растешь и процветаешь.', '', 54630),
(263268, 'ruRU', 'Мой дренейский довольно неплох!\n\nБлагодаря Джадаару я быстро выучил все ругательства, какие только есть в вашем языке! По-моему, этого вполне достаточно.', '', 54630),
(263267, 'ruRU', 'Я говорил Асрику, что тут все будут говорить на дренейском, но он все равно за мной увязался.\n\nЗнаешь, сколько дружеских услуг мне пришлось оказать миротворцам, чтобы его пустили?', '', 54630),
(263266, 'ruRU', 'Вот это кристаллы! Вот это размер!\n\nИ дренеи просто взяли и бросили их? Сейчас же попрошу, чтобы мне разрешили их расколоть!', '', 54630),
(263265, 'ruRU', 'Мы даже отсюда слышали взрывы на острове Кровавой Дымки!\n\nЭто было потрясающе!\n\nПочему меня не позвали?!', '', 54630),
(263264, 'ruRU', 'Неужто остров Кровавой Дымки и вправду может исцелиться, как это случилось с островом Лазурной Дымки?\n\nНадеюсь, Свет дозволит мне увидеть это собственными глазами.', '', 54630),
(263263, 'ruRU', 'Спасибо тебе еще раз за Атаанию, $n.\n\nМожет, она выглядит сердитой, но я вижу, что ей наконец-то стало полегче.\n\nИ за меня тоже спасибо! Я теперь могу рассказать всем механологам, над чем работаю!', '', 54630),
(263262, 'ruRU', 'Пока я сотрудничал с Консорциумом, научился паре приемов в работе с тканью Пустоты.\n\nХочешь, покажу?', '', 54630),
(263261, 'ruRU', '', 'Мы посвятили свою жизнь тому, чтобы уничтожить Пылающий Легион.\n\nМы многое обрели – но еще больше утратили. Упустили.\n\nИ теперь многие из нас мечтают сблизиться с нашими сородичами. Хотя это будет непросто.', 54630),
(263260, 'ruRU', '', 'Я, как и многие мои сородичи, слегка опасаюсь кающихся.\n\nНо, если подумать, они могут столько рассказать о наших врагах... пожалуй, мне это нравится!', 54630),
(263259, 'ruRU', 'Я поговорил с Арзаалом.\n\nУ нас с ним одни взгляды и, пожалуй, одно стремление.\n\nЕсли ему понадобится мой клинок, он его получит.', '', 54630),
(263257, 'ruRU', 'Занятно встретить здесь Теневой клинок.', '', 54630),
(263256, 'ruRU', 'Иди своей дорогой.', '', 54630),
(263255, 'ruRU', 'Это не просто возвращение домой.\n\nЭто возвращение в прошлое, в жизнь, о которой я страстно мечтал. Жизнь, которой я отдавал всего себя без остатка. Жизнь, которая ушла навсегда.\n\nНо я остался. Я еще здесь.\n\n Да, я изменился. И Шаттрат изменился. Но когда я снова туда вошел, началась новая жизнь.\n\nЕсли разбить самоцвет, то увидишь новые грани. И чем сильнее удар, тем ярче эти грани будут сиять. \n\nЭредары справятся со всем – и я вместе с ними.', '', 54630),
(263254, 'ruRU', 'Только наполовину.\n\nМеня вырастили дренеи. Некоторые из нас называют себя ошу\'неи – народ духа. \n\nЖаль, мои родители не дожили до этого дня.', '', 54630),
(263252, 'ruRU', 'Мне не довелось жить в эпоху, когда дренеи были единым народом.\n\nЯ рад, что раны наконец-то затягиваются.', '', 54630),
(263190, 'ruRU', 'Почему Тцада выбрала такую дорогу?.. Я подвел еще одного ученика.', '', 54630),
(263142, 'ruRU', '', 'Но порой я тешу себя надеждой, что она уцелела.', 54630),
(263074, 'ruRU', '', 'Гадрину понадобится новый ученик.\n\nУ Тцады был талант, но чтоб возглавить Черное Копье, одного таланта мало. Нужно сердце.\n\nВождь Рокхан хорошо справился. И ты тоже.', 54630),
(263073, 'ruRU', 'Черному Копью приходится несладко. Оно во тьме. Рад, что ты нас не забываешь.', '', 54630),
(263072, 'ruRU', '', 'Добро пожаловать на острова Эха, $n.', 54630),
(263071, 'ruRU', '', 'Слуги Мве\'залы сильны, но и мы не хуже.', 54630),
(263070, 'ruRU', 'Мве\'зала хочет испортить испытание? Не бывать этому.', '', 54630),
(263069, 'ruRU', 'Я бы все это время следовал пути Луку, если б знал, что она с нами. Но мы даже не знали ее имени. Не ведали, что она страдает.\n\nТцада искушала меня. Я устал чувствовать себя отбросом.\n\nНо теперь я исцелюсь. И ничего не забуду.', '', 54630),
(263068, 'ruRU', '', 'Мы еще не раз устроим испытания. Все в Черном Копье должны почувствовать, что у нас есть лоа.', 54630),
(263067, 'ruRU', 'Почти все тролли забыли про Джани.\n\nНо Джани не забудет этот день.', '', 54630),
(263066, 'ruRU', 'Племя теперь в равновесии. Бвонсамди – важный лоа, но с тех пор, как мы покинули старый дом, нам чего-то недоставало.', '', 54630),
(263065, 'ruRU', '', 'Много лет назад тролли Черного Копья потеряли дом, добрых друзей и своих лоа. Но племя не сгинуло, не спряталось, а продолжило расти. Это путь Луку. Мой путь. Я буду помогать.', 54630),
(263064, 'ruRU', 'Много лет прошло с тех пор, как я в последний раз слышал барабаны Черного Копья и пробовал подношения. Чувствую, скоро мы будем здесь как дома.', '', 54630),
(263063, 'ruRU', 'Старину Бвонсамди и Черное Копье ждет долгая дорога. Я буду приглядывать за троллями. \n\nЛуку и Кево йа Сити хорошо о вас позаботятся. Ну а я буду рядом, когда понадоблюсь.', '', 54630),
(263062, 'ruRU', 'Дело сделано.\n\nОстров Кровавой Дымки освободился от скрытой порчи и наконец-то восстановится от повреждений, которые нанес ему наш корабль.', '', 54630),
(263061, 'ruRU', 'Признаю, что задумка Велена... была неплохой.', '', 54630),
(263060, 'ruRU', 'Если Сиронас когда-нибудь возвратится, я лично разорву ее душу на части.', '', 54630),
(263056, 'ruRU', 'Если Хатуун и Арзаал правы, то мы можем покончить с демонами на острове раз и навсегда.\n\nЯ такую возможность не упущу.', '', 54630),
(263052, 'ruRU', 'Демоны оскверняют землю не только для того, чтобы пометить территорию, но и чтобы усилить самих себя.\n\nЧем злее Скверна, тем больше энергии они оттуда черпают. Словно металл, который раскаляется в пламени.\n\nВот почему ман\'ари велели сатирам спрятать распространителей Скверны.\n\nСейчас они наверняка уже очень сильны.', '', 54630),
(263051, 'ruRU', 'Не удивлен, что Велен подпустил демонов аж к своему порогу.\n\nПо крайней мере, теперь они мертвы. Я вполне доволен.', '', 54630),
(263048, 'ruRU', 'Пока что мы помогаем крокулам и озаренным на Аргусе. Лишь немногие из нас служат дренеям на Азероте.\n\nДело не в том, что нам не верят. Я лично наблюдаю за каждым кающимся и готов поручиться за него жизнью.\n\nДело в том, что мы не хотим тревожить дренеев. Они знают, что пророк протянул нам руку дружбы. Но это не отменяет того, что мы сотворили в прошлом.', '', 54630),
(263043, 'ruRU', 'Пророк говорит, ты помогаешь всем от лица кающихся.\n\nСпасибо. Благодаря тебе дренеи начнут нам доверять, и мы наконец-то сможем им помогать.', '', 54630),
(263041, 'ruRU', 'Несмотря на всю скверну, земля здесь такая... живая.\n\nТут есть трава, вода и ясное небо. Чистый воздух. Настолько чистый, что больно дышать.\n\nЕсли хоть один демон посмеет угрожать этому краю, я первым сверну ему шею.', '', 54630),
(263039, 'ruRU', 'Сатиры – это зараза, которую мы запустили. Слишком долго она отравляла остров Кровавой Дымки.\n\nЕсли бы получилось сдержать их хоть на время, чтобы они не мешали Тишамаату... Ну а потом я найду способ, как покончить с ними раз и навсегда.', '', 54630),
(263038, 'ruRU', 'Мне здесь не нравится.\n\nСлишком просторно. Слишком пусто. Тыл постоянно открыт. Никакой защиты.', '', 54630),
(263020, 'ruRU', 'Велен отправил посла на Аргус несколько дней тому назад и сообщил о Тишамаате. Я не могу приказывать своему народу. Те, кто хочет, явятся, а те, кто не хочет, – нет.\n\nЯ не хотел, но Велен отправил еще одно послание. Оно пришло сегодня. Он сказал, ему нужна моя помощь.\n\nЯ думал отказаться, но Велен... вел себя достойно в прошлый раз. К тому же мне нравится, когда он признает, что не может с чем-то справиться в одиночку.', '', 54630),
(263018, 'ruRU', 'Велен ждет нас на острове Кровавой Дымки.\n\nИдем. Пора все это заканчивать.', '', 54630),
(263017, 'ruRU', 'Я видел и худшее, но вполне разделяю тревоги Хатууна.\n\nПрошу, разберись с тем, что творится на острове Кровавой Дымки, до того, как начнется Тишамаат.\n\nЯ останусь здесь и позабочусь о раненых.', '', 54630),
(263015, 'ruRU', 'Надеюсь, это сработает...', '', 54630),
(262994, 'ruRU', 'Хватка Мве\'залы ослабевает. Это хорошо. \n\nЯ даже не знал о ней, пока снова не задышал свободно.', '', 54630),
(262992, 'ruRU', 'Рад, что ты снова с нами на островах, дружище. Много воды утекло, и у нас теперь все довольно скверно.\n\nТролли хотят стать сильнее, но не всегда поступают мудро.', '', 54630),
(262990, 'ruRU', 'Спасибо, $n. Я думал, она кинет в тебя чем-нибудь тяжелым, но все прошло как нельзя лучше!\n\nЯ очень рад, что у тебя получилось. Мои родители погибли, когда у меня даже копыта не окрепли. Атаания по сути заменила мне семью.\n\nНу ладно, я здесь все уберу. А потом увидимся на Тишамаате!', '', 54630),
(262988, 'ruRU', '', 'Вождь Рокхан считает, что у него получается скверно, но руш\'ка рождаются из моджо и намерения.\n\nОднако лоа любят, когда маска выходит красивой.', 54630),
(262983, 'ruRU', 'Когда мы закончим руш\'ки, лоа испытают нас. \n\nИногда нам велят отправиться в путь, иногда – сидеть и медитировать. Но все испытания нужны, чтобы тролль ощутил связь и с лоа, и с Черным Копьем.', '', 54630),
(262972, 'ruRU', 'Атаания? Что ж, значит, время пришло...\n\nТебе стоит поговорить с нашим экзархом.\n\nТвою душу уже тронула смерть. Значит, тебе надо просто сосредоточиться – и ты его увидишь.', '', 54630),
(262971, 'ruRU', 'Атаания? Что ж, значит, время пришло...\n\nТебе стоит поговорить с нашим экзархом.\n\nКажется, ты уже умеешь видеть мертвых. Сосредоточься – и он тебе явится.', '', 54630),
(262957, 'ruRU', 'На Аргусе всегда проводили Тишамаат для мертвых, чтобы помочь им сбросить мирские оковы и перейти в новую жизнь.\n\nЭти три души нестабильны, неспокойны. Надежда есть, но у нас пока никак не выходит освободить их – они слишком привязаны к этому миру.\n\nРаз мы снова празднуем Тишамаат, он может их спасти.', '', 54630),
(262955, 'ruRU', 'Я до сих пор помню тебя и твою помощь, $n, пусть уже много лет прошло с той поры.\n\nЯ был зол, рассержен... нет-нет, я был в ярости.\n\nНе знал, куда податься, после всего что случилось, и цеплялся за прошлое с такой силой, что похоронил себя под ним.\n\nНо благодаря тебе я обрел покой. Я перед тобой в неоплатном долгу. Спасибо, $n.', '', 54630),
(262954, 'ruRU', 'Прежде чем духи отправятся на Тишамаат, их надо успокоить.\n\nЭто сложный процесс. Спасибо, что помогаешь им.', '', 54630),
(262949, 'ruRU', 'Спасибо, что помогаешь с духами.\n\nЭкзарх Маладаар отведет тебя к гробницам.', '', 54630),
(262944, 'ruRU', 'А, их делает высший механолог Атаания в Шаттрате.\n\nМы знаем, что это не ее специальность, но она настояла, что будет собирать их сама.', '', 54630),
(262942, 'ruRU', 'Когда Аукиндон уничтожили, души, которые здесь покоились, разорвало на куски. А те, кто уцелел, впали в безумие.\n\nНо некоторых еще можно спасти. Мы знаем, что, если привязать душу к дозорному, она порой успокаивается. Как ребенок, которого спеленали. Вес плотного тела заземляет ее, сильные чувства уходят.\n\nМы не навсегда сажаем души в дозорных. Это просто костыли, на которые можно опираться, пока не поправишься.', '', 54630),
(262940, 'ruRU', 'Некоторые да.\n\nТех, кто погиб в Шаттрате, сожгли сразу после того, как вернули город. Мы постепенно переносим прах в Аукиндон и проводим погребальные обряды, которые не успели совершить.\n\nСо временем мы поможем и тем, кто пал на Пути Славы.\n\n<Лицо Немураана на мгновение кривится, точно от боли, но потом принимает суровое выражение. В его глазах читается решимость.>', '', 54630),
(262938, 'ruRU', 'Не совсем. Некоторые из нас укрылись от орков и остались.\n\nПосле того как захватчиков выгнали прочь, мы начали восстанавливать священные залы. Исправлять все, что успел натворить Совет Теней.\n\nМертвые заслуживают покоя, и в Аукиндоне им обещали покой. Оркам его не отнять – ни у тех, кто уже там покоится, ни у тех, кто однажды туда попадет.', '', 54630),
(262934, 'ruRU', 'Ты слышишь? Это музыка Д\'оре.\n\nКогда я впервые услышал, как эта дивная мелодия вернулась в Аукиндон, я зарыдал. Мы так долго трудились, чтобы отстроить наши храмы – и в такие минуты понимаешь, что все было не зря.\n\nМир – хрупкая вещь. Но то, что искренне любят, никогда не погибнет.', '', 54630),
(262930, 'ruRU', 'Хатаару был верховным механологом еще до Ромуула. Это значит, что он возглавлял всех остальных механологов.\n\nОн начертил планы Шаттрата и руководил его строительством. Еще он построил Карабор и все другие великие храмы.\n\nОн был потрясающим мастером! У меня в голографите есть все его лекции... по крайней мере те, что сохранились.', '', 54630),
(262927, 'ruRU', 'Я знаю, что Атаания помогла отстроить Аукенай, так что, надеюсь, они тоже помогут.', '', 54630),
(262920, 'ruRU', 'А почему художники не делают себе краску? \n\nНекоторые и вправду справляются сами, но работа с кристаллами и механология – разные области и требуют разных навыков. Свет определил каждому свое призвание.', '', 54630),
(262918, 'ruRU', 'Вижу, тебя интересует наше ремесло?\n\nВаятели перерабатывают кристаллы в материалы, которые нужны механологам. Обычно мы очищаем кристаллы, перековываем энергетические каналы, подпиливаем до нужных размеров и делаем огранку.\n\nА затем механологи собирают из них то, что им надо.', '', 54630),
(262853, 'ruRU', 'О, привет! Хочешь, расскажу про свой проект? Я изучаю прыгуан!\n\nОни умеют запрыгивать в другие измерения и прятаться там, но такой трюк вызывает возмущения в пространстве. У наших изобретений та же проблема.\n\nНо я работаю над устройством, которое все исправит! Если получится, то, быть может, мы усовершенствуем наши технологии, и города станут безопаснее.\n\nАтаания очень помогла мне с электросхемами. Наверное, она верит в мой проект!\n\n<Беруун так и сияет от гордости.>', '', 54630),
(262852, 'ruRU', 'Она отвечает за восстановление города! И не только Шаттрата, но и остальных наших поселений на Дреноре.\n\nИ, как я понял, работы все больше с каждым днем.\n\nНу, она говорит. Она любит это повторять, чтобы никуда не выбираться.', '', 54630),
(262850, 'ruRU', 'Еще раз скажу: стой на своем. Не слушай отказы Атаании.\n\nОна такая же, как остальные механологи: ее трудно вытащить из мастерской.\n\nНо она сделала кое-что совершенно особенное для своего народа. Я хочу, чтобы она лично им все показала.', '', 54630),
(262848, 'ruRU', 'Существа Аргуса такие же стойкие и выносливые, как мы.', '', 54630),
(262846, 'ruRU', 'Я рад, что Велен сдержал обещание и принял всех крокулов, которые захотели перебраться с Аргуса на Азерот.\n\nНе то чтобы я сомневался в пророке, но некоторый пессимизм вполне оправдан. Учитывая прошлое.\n\nНо, быть может, прошлое все-таки осталось в прошлом?', '', 54630),
(262843, 'ruRU', 'Пророк Велен... он... сейчас занят.\n\nОтправился выполнять одного ма-аленькое задание, которым хотел заняться в одиночку. Волноваться не о чем!\n\nОн обещал, что не опоздает на церемонию.', '', 54630),
(262841, 'ruRU', 'По той же причине, по которой забросили многие древние традиции.\n\nМы постоянно спасались от Легиона. Все наше время и все силы уходили на борьбу за выживание.\n\nКому какое дело, чем мы занимались вчера, если завтра попросту может не наступить?\n\nНо теперь все изменилось! И это прекрасно.', '', 54630),
(262595, 'ruRU', 'Луку не зря злится, но все это уже давно в прошлом.', '', 54630),
(262488, 'ruRU', '', 'Джани – лоа собирателей и секретов. Ищи вещи, которые выбросили, но которые еще могут пригодиться или значат хоть что-нибудь.\n\nА еще он лоа воров. Но не стоит красть у своих, чтобы ему понравиться.', 54630),
(261279, 'ruRU', 'Беруун пытается скрыть улыбку.', '', 54630),
(261278, 'ruRU', 'Экзарх Хатаару кланяется и улыбается вам.', '', 54630),
(261276, 'ruRU', '', 'Мы многое знаем о происхождении Темного сердца, но почти ничего о его назначении...', 54630),
(261272, 'ruRU', '', 'Драконий Погост служит могилой Галакронду, изначальному дракону, который чуть не пожрал весь мир. Его победили драконьи Аспекты, в то время еще не получившие благословение титанов. Все это было тысячи лет назад.\n\nИридикрон решил воспользоваться силой Галакронда. Он заручился помощью рода Бесконечности и отправился во время, где изначальный дракон только-только умер. Там Иридикрон насытил артефакт изначальной силой, которая еще теплилась в теле исполина. Так и родилось Темное сердце...\n\nМы знаем о происхождении артефакта и о том, что он оказался в руках Предвестницы. Осталось выяснить, какой силой он обладает и что Предвестница собирается с ней делать.', 54630),
(261263, 'ruRU', 'Экзарх Хатаару молча указывает на сейф.', '', 54630),
(261221, 'ruRU', '<кряхтит>', '', 54630),
(261217, 'ruRU', '', 'Я рада, что все для себя поняла. Мне не нужен другой облик. Нынешняя \"я\" – это \"я\" настоящая.', 54630),
(261205, 'ruRU', 'Приветствую тебя, Пробудитель.', '', 54630),
(261134, 'ruRU', 'Некоторые считают, что сила Бездны несет Азероту только вред и разрушения. Но странники разломов намерены спасти мир именно с помощью этой силы. Странное противоречие, не правда ли? \n\nНо мы сами воплощаем не одно противоречие, живя в этом безжизненном месте.', '', 54630),
(261092, 'ruRU', '', 'Я помню его так хорошо, будто это было вчера!\n\nКак же я волновалась... Я понятия не имела, какой облик выбрать, расспрашивала драконов по всему Азероту! Разговоры мне помогли, но ни один из обликов товарищей мне не подходил.\n\nИ тогда я поняла, что важно выбрать тот облик, который лучше всего тебя воплощает. Я не вижу себя великим воином, героем или завоевательницей. \n\nЯ просто помогаю остальным, чтобы у Азерота было светлое будущее!\n\nА мой выбор лучше всего для этого подходит.', 54630),
(261085, 'ruRU', 'Выбирая свой облик, Хроми пришла ко мне за советом, почти как Эмберталь сейчас.\n\nЭто была наша самая первая встреча, и тогда Хроми была еще не той уверенной и остроумной гномихой, которую ты знаешь.\n\nОна страшно мучилась с выбором и спрашивала одного дракона за другим, почему он выбрал свой облик.\n\nЯ ответил искренне, что предпочитаю проводить время среди смертных, а в этом облике могу общаться с ними на равных.\n\nКогда наступил день церемонии, нам не терпелось увидеть, что же она выберет. \n\nДолжен признать, такого облика никто не ожидал. Зато он уникален для Хроми. Мне кажется, он идеально ей подходит.', '', 54630),
(261047, 'ruRU', 'Ого! Вопрос непростой...\n\n<Исха некоторое время обдумывает ответ.>\n\nЧто ж... пока я не познакомился с Тару, мне было еще сложнее принимать решения, чем сейчас. Я всегда предпочитал подождать, оценить ситуацию, все взвесить, а уже потом начать действовать.\n\nЯ такой и сейчас, но общение с Тару научило меня поменьше сомневаться.\n\nОн не пытается меня изменить, зато всегда готов сделать то, на что не способен я.\n\nВместе мы образуем отличную команду.', '', 54630),
(261046, 'ruRU', 'Я всегда был уверен в себе.\n\nСпроси, например, Исху. Он скажет, что я безрассудный, наглый и импульсивный. И будет совершенно прав!\n\n<Тару хохочет.>\n\nНо общение с Исхой немного сгладило эти качества. Мы оба драконоиды, но полная противоположность друг друга. Зато его качества отлично дополняют мои.\n\nОтличия только подчеркивают нашу уникальность.', '', 54630),
(261045, 'ruRU', '', 'Я доверяю Аллерии. Я прошла с ней через приключения, войну и даже смерть. И, если понадобится, последую за ней в саму Бездну.', 54630),
(261044, 'ruRU', '', 'Эльфы крови зря покинули Альянс и присоединились к Орде. Эти глупцы стали марионетками злых сил и выполняли любую их прихоть, пока те дергали за ниточки. \n\nНо я свои нити обрезала. Мною никто не может управлять. Ни магистры, ни Бездна. Ни даже Аллерия Ветрокрылая.', 54630),
(261043, 'ruRU', 'Бездна – это не какое-то место далеко отсюда. Она здесь, во всех нас. \n\nЭто такая же сила, как гравитация, сознание или грусть. Эта энтропийная энергия пронизывает все вокруг. Мы не в силах ее остановить. Остается только принять.', '', 54630),
(261042, 'ruRU', 'Луносвет предал свой народ, когда объединился с Ордой. Поэтому я ушел. Лучше быть изгоем, оказаться в самом далеком уголке вселенной, чем выслушивать лживые речи магистров.', '', 54630),
(261041, 'ruRU', '', 'Не все соглашаются с тем, что я свободно пользуюсь магией.\n\nНо я считаю, что раз мы и так отдаем себя на милость Бездны и рискуем собственным рассудком, то почему бы не поразвлечься с обретенными силами?', 54630),
(261040, 'ruRU', '', 'Некоторые смотрят в ночное небо и не видят ничего, кроме темноты. Но лишь в темноте видно, как сияют звезды. \n\nТак и с народом рен\'дорай. Наша сила кроется в том, что даже в самой темной тени мы можем найти свое предназначение.', 54630),
(261039, 'ruRU', 'У меня нет времени это обсуждать. У нас с Исхой есть очень важные дела. Это касается местной экосистемы! Может быть, ты нам поможешь?', '', 54630),
(261038, 'ruRU', 'У меня нет времени это обсуждать. У нас с Тару есть очень важные дела. Это касается местной экосистемы! Может быть, ты нам поможешь?', '', 54630),
(258435, 'ruRU', '', 'Кадгар рассказал мне, что послал тебя и Аллерию раскрыть тайну Темного сердца. Приятно знать, что этим делом занимаются наши лучшие герои.', 54630),
(258392, 'ruRU', '', 'Ну уж нет, еще как будет!', 54630),
(258391, 'ruRU', 'Значит, праздника не будет?', '', 54630),
(258390, 'ruRU', '', 'Ох, Эмберталь, как я рада это слышать.', 54630),
(258388, 'ruRU', '', 'Я – это я. И все. Этого достаточно.', 54630),
(258385, 'ruRU', '', '$p, все твои истории – они не о том, как найти себя. Они о том, как принять себя.', 54630),
(258383, 'ruRU', '', 'Он мне не нужен.', 54630),
(258378, 'ruRU', 'Что?', '', 54630),
(258377, 'ruRU', '', 'Я не буду выбирать второй облик.', 54630),
(258376, 'ruRU', 'Наконец-то! Жду не дождусь!', '', 54630),
(258374, 'ruRU', '', 'Как здорово!', 54630),
(258371, 'ruRU', '', 'Внимание! Я послушала истории других и наконец-то приняла решение.', 54630),
(258309, 'ruRU', '', 'Что тебе удалось узнать о том, что значит быть собой?', 54630),
(258308, 'ruRU', '', 'Он думал, его сородичи настолько ограниченные, что стали бы высмеивать его за любовь к знаниям?\n\nНет, я не могу выстраивать свою личность на такой мелочи.\n\nИ я не интересуюсь ничем спорным или хотя бы необычным.\n\nМожет, раз у меня нет особых интересов, то мне и облик выбирать незачем?', 54630),
(258307, 'ruRU', '', 'Ты про этих двух детенышей в дальнем углу? Да чему они могут меня научить?\n\nХотя... они подходят к вопросу совершенно по-другому. С практической точки зрения.\n\nСоглашусь с Клареттой. Какой смысл менять облик, если с ним я не смогу защитить себя и других?\n\nДумаю, мне все-таки есть чему поучиться у детенышей.', 54630),
(258306, 'ruRU', '', 'Пф! Дети.\n\nМногие мечтают стать матерями и становятся, но я такого не желаю.\n\nВерю, что Палла думает, будто нашла путь, который избавит ее от тревог. Но мне так не кажется.\n\nБоюсь, забота о новом члене семьи может добавить новых переживаний, а не убавить. \n\nНекоторые посвящают всю свою жизнь материнству и действительно находят в этом призвание и утешение. \n\nНо я хочу найти себя, а не заполнить пустоту в душе.\n\nМое нынешнее положение вполне меня устраивает.', 54630),
(258305, 'ruRU', '', 'Потерять саму себя – а потом восстать из мертвых и служить Королю-личу... Никому такого не пожелаю.\n\nПохоже, Дория сильна духом. Она победила обстоятельства и обрела новую жизнь.\n\nНо она не помнит саму себя в прошлом. \n\nПочему же она думает, что знает себя настоящую?', 54630),
(258304, 'ruRU', '', 'Варден не выбирал свою судьбу.\n\nНо он смирился с ней и научился жить дальше. Не думаю, что смогла бы спокойно разговаривать с теми, кто испортил мне жизнь.\n\nОн сумел принять ту часть себя, которая досаждала ему много лет подряд. Ту часть, которую ему навязали и которую он не мог изменить.\n\nДолжно быть, непросто было жить, испытывая ненависть к самому себе.\n\nЯ же такого не чувствую. Вардену нечего мне посоветовать.', 54630),
(258303, 'ruRU', '', 'Эта эльфийка по собственной воле впустила в себя Бездну и овладела ее силами? На Азероте и впрямь настали странные времена.\n\nМне нравится, с какой уверенностью она защищает свой выбор. Но за такие решения всегда нужно платить.\n\nОна нашла место среди себе подобных, но родная семья отвергла ее с презрением.\n\nНе думаю, что у моего выбора будут такие серьезные последствия.', 54630),
(258300, 'ruRU', '', 'Вот это храбрость! Он решился пройти через страшную трансформацию и при этом понимал, что его ждет.\n\nГоворишь, он сделал это, чтобы защитить других? Могу его понять.\n\nПравда, мне не нужно заключать сделки с демонами, чтобы защищать своих близких.\n\nПо правде говоря, второй облик скорее будет мешать в битве, чем помогать.\n\nНо, думаю, Сталвин кое в чем прав.', 54630),
(258298, 'ruRU', '', 'Незерил был убежден, что его новый облик сможет защитить его народ.\n\nНастолько, что поставил на кон не только свою жизнь, но и чужие.\n\nПрежде чем друиды серпа раздобыли Косу Элуны, принимать облик волка было крайне опасно. Такие друиды теряли рассудок, превращаясь в диких зверей.\n\nЯ рада, что он вновь обрел себя и стремится уберечь других от тех же ошибок. Но хорошо подумав перед тем, как сделать необратимый шаг, он мог бы избежать множества бед.\n\nМне тяжело сочувствовать его судьбе.', 54630),
(258289, 'ruRU', '', 'Кто тебе это сказал?', 54630),
(258252, 'ruRU', '', 'Эмберталь, стой!', 54630),
(258251, 'ruRU', '', 'Боюсь, теперь я понимаю еще меньше, чем понимала вначале. Прости, $p.', 54630),
(258246, 'ruRU', '', 'Эти ответы мне не помогли. Хорошо, что они знают себя, но у меня нет тех качеств, которые они себе приписывают.', 54630),
(258188, 'ruRU', '', 'Пелла сказала, мне нельзя говорить с чужими!', 54630),
(258187, 'ruRU', 'Стая превыше всего.', '', 54630),
(258183, 'ruRU', 'Мой ответ на вопрос \"Кто я такой?\" постоянно меняется. Если бы мне задали его в былые времена, до проклятия, я бы ответил – преданный защитник своего народа. В ту пору я был готов сделать что угодно, чтобы сородичам ничто не угрожало. И сделал. Но зашел слишком далеко и прожил сотни лет как безмозглое животное. Повиновался лишь инстинктам. После такого нельзя остаться прежним.\n\nСколько же времени я потерял?..\n\nНо с той поры я познал смирение и через смирение обрел себя. Я друид, который хочет не сражаться, а наставлять. Учить будущие поколения тому, как опасна бывает гордыня. \n\nКто я сейчас? Ворген. И учитель.', '', 54630),
(258182, 'ruRU', 'Когда-то я думал, что я – это только моя человеческая половина. Разве могу я быть лохматым клыкастым чудовищем? \n\nЯ отказывался называть себя воргеном. Говорил себе, что это проклятие, свалившееся мне на голову, больше ничего.\n\nНо мне снилась охота. Я чуял свежесть ночного леса. Я больше не мог отрицать очевидного. Пришло время смириться и принять того, кем я стал.\n\nЯ Варден Клэридж. Я ворген. Я не выбирал свою судьбу, но и не отвергаю ее.', '', 54630),
(258181, 'ruRU', '', 'Я смотрю на себя глазами своей семьи.\n\nЯ нашла Мову, когда она была еще совсем малышкой, крошечной и беспомощной. Ей не на кого было надеяться, не на кого опереться – только на меня.\n\nДо того, как у меня появилась Мова, я постоянно из-за чего-то беспокоилась. Из-за чего-то неважного, несущественного, и тревоги заполняли все мои дни.\n\nНо когда я стала матерью, то обрела покой. Все стало неважным, кроме Мовы. Она показала, что на самом деле главное в жизни. По крайней мере, для меня.\n\nЯ – это моя семья.', 54630),
(258180, 'ruRU', '', 'Поиск себя – это каждодневная трудная борьба.\n\nМногие рен\'дорай, особенно новички, сильно тревожатся, что утратят себя, потеряются в Бездне. Кое в чем они правы. Отделять свои собственные мысли от теней порой бывает непросто.\n\nЯ больше не мыслю себя без Бездны, как рыба не мыслит себя без воды. Однако я не боюсь.\n\nДа, я изменилась, но когда я вспоминаю себя в прошлом, то понимаю, что Бездна всегда была со мной. Бездна есть в каждом.\n\nА значит, на самом деле я почти не изменилась.', 54630),
(258179, 'ruRU', 'Я – воин и ученый.\n\nОдно не исключает другого. Мне нравятся и пыльные книги, и окровавленные черепа.\n\nВ прошлом я прятался от боевых товарищей. Боялся, не поймут.\n\nНо я ошибся. В клане только посмеялись. Сказали, и так знают мой секрет. Что я люблю читать.\n\nМне больше не нужно называть себя воином и только воином.\n\nВедь это лишь часть меня.', '', 54630),
(258177, 'ruRU', 'Я тот, кем всегда был.\n\nМой долг остался прежним – защищать тех, кто мне дорог. \n\nИ для этого я впустил в себя Скверну. Пожертвовал глазами и душой. Демоническая сила изменила мою сущность, но Сталвин никуда не делся. Он все еще здесь.\n\nСемья, правда, этого не поняла. Для них я чересчур изменился. Они верят, что много лет назад потеряли сына.\n\nЗачем они меня оплакивают? Неужто не понимают, что я сделал это ради них?', '', 54630),
(258176, 'ruRU', '', 'Я почти не помню, кем была при жизни. Кажется, вместо меня по земле ходила совсем другая эльфийка.\n\nСейчас я та, кого ты видишь перед собой. У меня другое имя, не то, что было раньше. Я слишком сильно изменилась.\n\nКогда-то я не могла принять свое новое тело. По правде говоря, до сих пор не могу. Мне не хватает биения сердца. Я тоскую по теплой крови. Как же я ненавидела новую себя... по крайней мере, я так думала. \n\nОказалось, что я испытывала ненависть не к себе, а к тому, что не смогла выбрать, кем быть. Это право у меня украли. Я все еще мечтаю о той, другой себе, кем могла бы стать. Но понимаю, что если буду держаться за прошлое или за будущее, которому не бывать, то заберу у себя настоящее. Проживу не свою жизнь.', 54630),
(258124, 'ruRU', '', 'Признаться, в глубине души я всегда знала, что должна стать художницей.\n\nЯ никакой не Страж Дорог. Я просто не вписываюсь.\n\nСтоило принять эту простую мысль, как я сразу стала гораздо счастливее и больше не пытаюсь сломать себя.\n\nКогда перестаешь сражаться со своей сутью, то обретаешь покой.\n\nНо порой для этого приходится перешагнуть через желания родных и близких.', 54630),
(258123, 'ruRU', '', 'Служить Маре – самый почетный долг!\n\nПравда, я не сама выбирала эту роль: меня создали, чтобы я служила. Но я никогда ни в чем не сомневалась! И никаких неудобств тоже не испытывала.\n\nЯ горжусь своей работой, как и все рефти леди Мары.\n\nЗдорово чувствовать, что ты на своем месте. Это большое счастье.\n\nЯ та, кто я есть.', 54630),
(258122, 'ruRU', '', 'Здравствуй, $p. \n\nМожет быть, дриады и кентавры выглядят как сородичи, но на самом деле мы очень разные. Но ведь не зря говорят, что противоположности притягиваются!\n\nПочти все мои товарищи по клану считают, что общение с дриадами – пустая трата времени. Что дриад интересуют лишь свои сады, а на остальном их внимание не задерживается.\n\nВозможно, это и так, но меня все равно так и тянет провести с ними время. Должно быть, это моя особенность.\n\nОгромное тебе спасибо за помощь.', 54630),
(258121, 'ruRU', 'Дружба с Нарманом – очень важная часть меня.\n\nПомню, как старейшина Огдерел без конца ворчал и недовольно топал копытами.\n\nДа, мы соблюли далеко не все церемонии и традиции. Но мы знали, что поступаем правильно.\n\nРад, что наши сородичи согласились с хан Саран.', '', 54630),
(258120, 'ruRU', 'Традиции клана велят, чтобы мы брали себе в названные братья только лучших охотников. Достойных охотников.\n\nНо когда я встретил Даву, то понял, что отступлю от традиций.\n\nОбычаи важны, спору нет, и клан Шикаар – это часть меня, но... только часть.\n\nЯ сам принял решение и выбрал себе в друзья того, кого захотел. Как я рад, что хан Саран увидела, что я действовал искренне.', '', 54630),
(258119, 'ruRU', 'Я не такой, как другие гноллы. Я первый мон-арх!\n\nУ других гноллов нет друзей.\n\nА я люблю друзей. \n\nНе хочу меняться.', '', 54630),
(258114, 'ruRU', '', 'Слушай, тут есть одна задачка, связанная с дриадами... Может быть, ты с ней поможешь?', 54630),
(258113, 'ruRU', 'Сначала мне нужно кое-что сделать. Кстати, мне бы очень пригодилась твоя помощь.', '', 54630),
(258112, 'ruRU', 'Прости, давай поговорим об этом потом. Сперва надо завершить важное дело. Если, конечно... ты не хочешь мне помочь.', '', 54630),
(258111, 'ruRU', '', 'У меня нет времени на разговоры. Мара ждать не может. Прошу, помоги нам.', 54630),
(258110, 'ruRU', '', 'Сначала мне надо разобраться с тарасекками, разграбившими мой лагерь! Не поможешь?', 54630),
(258109, 'ruRU', 'Нет времени. Есть важные дела. Помогай сначала!', '', 54630),
(258107, 'ruRU', 'Здравствуй.', '', 54630),
(257996, 'ruRU', 'Слушай...\n\nНам тут не нужны герои, убивающие богов.\n\nЗнаешь какого-нибудь загорелого головореза? Вот его и приводи.', '', 54630),
(257872, 'ruRU', '', 'Как мне удалось понять, кто я? Мне кажется, что мой второй облик – это и есть я настоящая. Странно, правда?\n\nЯ сразу это поняла, когда в первый раз превратилась. \n\nТеперь я могу быть собой. Не солдатом, не драктиром, а просто Тэллин. \n\nА эти волосы? Их же можно по-разному укладывать, да еще когда захочешь! Хоть каждый день! Потрясающе!', 54630),
(257871, 'ruRU', '', 'Знаю, моя подруга иного мнения, но для меня находиться в другом облике страшно неудобно.\n\nЧешуя, клыки, крылья, хвост... без них мне просто не по себе. Я драктир и всегда им буду.\n\nА в человеческом облике я ни до чего не могу дотянуться! \n\nЯ та, кто я есть. Мне не нужно в себе что-то менять.\n\nУ второго облика, конечно, есть преимущества, но ни один из них не передаст всей моей красы и свирепости.', 54630),
(257851, 'ruRU', 'Я – все еще Варден. Несмотря ни на что.', '', 54630),
(257850, 'ruRU', '', 'В каждом из нас есть своя Бездна.', 54630),
(257849, 'ruRU', '', 'Моя семья – это моя жизнь.', 54630),
(257848, 'ruRU', '', 'Из-за Мовы мы не знаем ни покоя, ни отдыха.\n\nНет, конечно, она – радость и счастье каждого дня, но порой хочется, чтобы обитатели нашего дома линяли чуть-чуть поменьше. \n\nКаждый раз приходится изрядно потрудиться, чтобы вымести всю шерсть.', 54630),
(257847, 'ruRU', '', 'Что за сила – и без ума?', 54630),
(257844, 'ruRU', '', 'Эти \"волосы\" – и вправду занятная штука!', 54630),
(257843, 'ruRU', '', 'Мне как-то неловко без чешуи...', 54630),
(257842, 'ruRU', 'Я пошел на необходимые жертвы, чтобы защитить тех, кого люблю.', '', 54630),
(257841, 'ruRU', '', 'Я обрела себя в нежизни.', 54630),
(257809, 'ruRU', '', 'Мне кажется, ты слишком мудришь, Эмберталь. Все не так сложно.', 54630),
(257808, 'ruRU', '', 'Вот она я, посмотрите на меня. Я всегда так выглядела. Зачем мне меняться?', 54630),
(257804, 'ruRU', '', 'Что? Ты до сих пор не выбрала второй облик? Думаешь, ты все еще не готова?', 54630),
(257478, 'ruRU', '', 'Моя семья уже никогда не воссоединится. Как больно это осознавать...', 54630),
(257273, 'ruRU', 'Ты поступил правильно, верховный друид. Выбор был трудный и неприятный – но верный.', '', 54630),
(257272, 'ruRU', 'Мне жаль, Келестра, но тебе придется похоронить сестру в другом месте.', '', 54630),
(257271, 'ruRU', 'Это было бы несправедливо по отношению ко всем, кто погиб в битве с воинами стихий, кто пытался их остановить.', '', 54630),
(257270, 'ruRU', 'Я не могу допустить, чтобы она покоилась здесь, в земле, ради которой мы пролили столько крови.', '', 54630),
(257269, 'ruRU', 'Келестра, твоя сестра сражалась на стороне воинов стихий. Она принесла немало горя нам и нашим союзникам.', '', 54630),
(257267, 'ruRU', '', 'Спасибо. Спасибо вам обоим. Теперь я снова обрету покой, о котором уже не смела и мечтать.', 54630),
(257266, 'ruRU', 'Келестра, я разрешаю тебе похоронить сестру с остальными родными.', '', 54630),
(257265, 'ruRU', 'Королет не нашла покоя при жизни. Возможно, она обретет его в вечном сне под корнями нового Древа.', '', 54630),
(257264, 'ruRU', 'Однако за свои преступления она поплатилась жизнью.', '', 54630),
(257263, 'ruRU', 'Келестра, твоя сестра сражалась на стороне воинов стихий. Она принесла немало горя нам и нашим союзникам.', '', 54630),
(257261, 'ruRU', 'Ситуация сложная. \n \nЯ не знал, что сестра Келестры – это Королет, воин стихий и предательница.\n \nОна воевала с нами, но есть некоторые доказательства того, что позднее Королет все-таки перешла на нашу сторону, как сделали многие воины стихий.\n \nИ все же... искупает ли это ее грехи?\n\n<Малфурион задумчиво хмурится.>', '', 54630),
(257260, 'ruRU', 'Королет примкнула к воинам стихий! Она предала нас! Если мы похороним ее у Амирдрассила, то оскорбим память всех, кто лишился жизни из-за ее безумия.\n \nМы все многое потеряли, когда сгорел Тельдрассил. Боль того дня до сих пор в наших сердцах. И это не оправдывает действия Королет. \n\nОна сама выбрала такой путь и должна была знать о последствиях.', '', 54630),
(257258, 'ruRU', 'Спокойно. Не будем горячиться.', '', 54630),
(257257, 'ruRU', 'Не смей осквернять эту обитель грязными костями предательницы!', '', 54630),
(257249, 'ruRU', '<Под песком было ожерелье с такими же узорами, как на ожерелье Келестры.>', '<Под песком было ожерелье с такими же узорами, как на ожерелье Келестры.>', 54630),
(257247, 'ruRU', '<Не осталось никаких признаков, по которым можно было бы опознать эти кости, но тут ваше внимание привлекает что-то блестящее.>', '<Не осталось никаких признаков, по которым можно было бы опознать эти кости, но тут ваше внимание привлекает что-то блестящее.>', 54630),
(257246, 'ruRU', '<Судя по останкам, погибший был гораздо ниже ростом, чем ночной эльф. Скорее всего, они принадлежат вульпере, гоблину или гному.>', '<Судя по останкам, погибший был гораздо ниже ростом, чем ночной эльф. Скорее всего, они принадлежат вульпере, гоблину или гному.>', 54630),
(257245, 'ruRU', '<На этих останках еще остались лоскуты облачения воина стихий.>', '<На этих останках еще остались лоскуты облачения воина стихий.>', 54630),
(257243, 'ruRU', '<Эти кости явно принадлежат троллю, а не ночному эльфу.>', '<Эти кости явно принадлежат троллю, а не ночному эльфу.>', 54630),
(257242, 'ruRU', '<Эти кости побелели от солнца – они явно лежат здесь очень давно.>', '<Эти кости побелели от солнца – они явно лежат здесь очень давно.>', 54630),
(257237, 'ruRU', '', 'Я перешла на другую сторону, когда узнала, что нашей целью во Сне было новое Древо Жизни. Точно не знаю, было ли это известно Королет, но не удивлюсь, если от нее скрывали правду. \n\nЯ не верю, что она могла намеренно причинить вред Амирдрассилу. Будь она сейчас жива, то стояла бы здесь, с нами.', 54630),
(257236, 'ruRU', '', 'Если бы я сразу знала, что задумал Фиракк...', 54630),
(257235, 'ruRU', 'Я почти ничего не знаю про Королет. Старался по возможности избегать ее. Она ненавидела Орду и даже к представителям ордынских рас среди воинов стихий относилась жестоко.\n\nКажется, она стала воином стихий, когда Альянс согласился на перемирие. Она поклялась отомстить за Тельдрассил, и раз Альянс больше не собирался уничтожать Орду, она нашла себе другого союзника.\n\nПоследствия ее не волновали.', '', 54630),
(257234, 'ruRU', 'Я просто хочу исправить свои ошибки и устранить ущерб. Что тебе нужно?', '', 54630),
(257233, 'ruRU', 'Королет вселяла в нас ужас. Огонь Тельдрассила покрыл ее лицо шрамами и опалил волосы. Говорят, она потеряла тогда всю свою семью.\n\nНенависть к Орде поглотила ее. Она была готова на все, чтобы ее уничтожить. Ничто не могло встать на ее пути.', '', 54630),
(257232, 'ruRU', 'Да, |3-6($r)? Что тебе нужно?', '', 54630),
(257231, 'ruRU', '', 'Королет была одним из самых могучих шаманов бури среди воинов стихий. Навыки друида-вороны помогли ей обуздать силу стихий быстро и в высшей мере.\n\nИменно поэтому она возглавила первую атаку на Изумрудный Сон. Как бывший друид, она знала о Сне и его лазейках больше, чем кто-либо другой.', 54630),
(257229, 'ruRU', '', 'Чем могу помочь?', 54630),
(257199, 'ruRU', '', '<Келестра глубоко потрясена, ее руки дрожат.>\n\nЭто правда? Ты знаешь, что случилось с Королет?', 54630),
(257195, 'ruRU', 'Если не веришь мне, поговори с воинами стихий в сторожевой башне Сумерек. Они тебе все расскажут.', '', 54630),
(257194, 'ruRU', '', 'Нет... этого не может быть...', 54630),
(257193, 'ruRU', 'Королет – твоя сестра?! Она была предательницей и воином стихий! Она заслужила свою участь.', '', 54630),
(257192, 'ruRU', '', 'Если кто и мог пережить такое падение, то это моя сестра Королет.', 54630),
(257191, 'ruRU', '', 'Должно быть, ее кости до сих пор там, на дне Сокрытого моря.', 54630),
(257190, 'ruRU', '', 'Со временем мне удалось найти тела родителей и брата. Но сестра пропала.', 54630),
(257189, 'ruRU', '', 'Остальным... так не повезло.', 54630),
(257188, 'ruRU', '', 'Силы покинули ее, и чары рассеялись. Мы камнем упали в море. Я пострадала от падения, но смогла выжить.', 54630),
(257187, 'ruRU', '', 'Но что-то пошло не так. Пока мы спускались на ветру, сестра врезалась в горящую ветвь. Огонь тут же перекинулся на одежду, охватил ее целиком.', 54630),
(257186, 'ruRU', '', 'Мы должны были прыгнуть с древа. Используя свои силы ветра, она бы подхватила нас и плавно спустила бы к берегу.', 54630),
(257185, 'ruRU', '', 'Дорогу в Дарнас перегородило пламя, и сестра повела нас на восток, к самому краю кроны Тельдрассила. Она придумала, как выбраться.', 54630),
(257184, 'ruRU', '', 'Объявили эвакуацию. Начался полный хаос. Повсюду огонь. До сих пор отчетливо помню тот запах...', 54630),
(257183, 'ruRU', '', 'Мы жили в деревне Доланаар, высоко в ветвях Тельдрассила. Мы знали, что к нам может прийти война, но не думали, что...', 54630),
(257181, 'ruRU', '', 'В тот день мы собрались вместе, чтобы отметить успехи моей старшей сестры. Она прошла обучение и стала друидом-вороной.', 54630),
(257175, 'ruRU', '', '[TBD][DNT]', 54630),
(257169, 'ruRU', '', 'Я никогда прежде не бывала в обителях. Сестра рассказывала, что друиды здесь не просто спят и встречаются друг с другом. Их тут еще и хоронят. Она говорила, ближайшие родственники друидов тоже могут здесь упокоиться. \n\nСестре нравился этот обычай. Надеюсь, я помогу родным обрести заслуженный покой.\n\nЯ готова приступать.', 54630),
(257066, 'ruRU', 'Выбрать маскировку.', 'Выбрать маскировку.', 54630),
(256817, 'ruRU', '', 'Не знаю. Надеюсь, расследование Джайны принесет плоды. Чем скорее мы все поймем, тем лучше.', 54630),
(256816, 'ruRU', 'Удивительно. И ты до сих пор не знаешь, почему оно выбрало тебя? Больше никто в Совете его не видел.', '', 54630),
(256815, 'ruRU', '', 'Теплой. Спокойной. Я как будто вернулась домой из чужих краев. Но само видение я не помню.', 54630),
(256812, 'ruRU', 'Какой она была, Модера? Я про Сияющую Песнь.', '', 54630),
(256809, 'ruRU', 'И я намерен пустить эти способности в дело. Не сомневайся.', '', 54630),
(256808, 'ruRU', 'Иначе и быть не могло. Нам тут всегда нужны маги с такими способностями, как у тебя.', '', 54630),
(256807, 'ruRU', 'И вправду много лет прошло. Хорошо, что Совет принял меня обратно.', '', 54630);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(256806, 'ruRU', 'Столько лет прошло, Дренден. Рад, что ты вернулся в Даларан.', '', 54630),
(256715, 'ruRU', 'Моя первая и самая трудная ученица. Быть может, однажды Аллерия образумится.\n\nНадеюсь, это случится не слишком поздно.', '', 54630),
(256711, 'ruRU', '', 'Похоже, твое расследование оказалось успешней моего.\n\nЯ расспрашивала всех, кто утверждал, будто видел Сияющую Песнь. Пыталась понять, что все это значит. Но между очевидцами не нашлось никакой связи. К тому же никто из них не понимал, что означает видение.\n\nНеужели Странник прав, и это видение ниспослала сама Азерот? Надо обратиться к Вестнику души мира. Я должна поговорить с Магни.', 54630),
(256656, 'ruRU', 'Это хороший вопрос. Я уже был учителем – давным-давно, когда рассказал Аллерии, что такое Бездна и что она может дать. Но Аллерия доказала, что достойна моих уроков: она помогла мне сбежать от Легиона.\n\nКак знать, быть может, на сей раз мне просто интересно, что из этого выйдет? В конце концов, рен\'дорай – довольно любопытные существа. А Телогрус – любопытное явление.', '', 54630),
(256650, 'ruRU', 'Неплохо. Примерно так, как того и стоит ожидать, учитывая все обстоятельства. Телогрус гостеприимным не назовешь, но мы уже привыкли. Не всем легко даются новые силы, но Странник учит нас, как с ними справляться. Советую послушать его лекцию, если найдешь время.\n\nИ, конечно, хочу поблагодарить тебя за помощь, $n. Все твои героические поступки показывают Азероту, кто такие рен\'дорай. Надеюсь, однажды нас примут. Может, мы даже когда-нибудь вернемся в Кель\'Талас...\n\n<Он печально улыбается.>\n\nКогда-нибудь. Если повезет.', '', 54630),
(256649, 'ruRU', 'Когда-то я был магистром Кель\'Таласа. Но меня изгнали оттуда – так же, как и многих других магов, которые изучали Бездну и отказались бросать свою работу.\n\nСо временем Бездна изменила нас. Мы назвали себя рен\'дорай, эльфами Бездны, и поселились в Телогрусе.\n\nМы с Аллерией представляем и возглавляем всех рен\'дорай.', '', 54630),
(256646, 'ruRU', 'Рен\'дорай готовы защитить Азерот от тени.', '', 54630),
(256620, 'ruRU', 'Странник заявляет, что в прошлом его сородичи, эфириалы, увидели нечто похожее на то, что сейчас видят жители Азерота. Я про Сияющую Песнь. Однако вскоре повелитель Бездны Пространствус уничтожил весь тот мир.\n\nЗначит ли это, что Сияющая Песнь предупреждает, что и нашему миру недолго осталось? Может, к нам взывает его душа? Азерот? Я боюсь, это как-то связано с Ксал\'атат и Темным сердцем.\n\nНам нужен совет Вестника Азерот, но Магни до сих пор не откликается. Джайна вызвалась отыскать его, как только поговорит с Траллом. Не удивлюсь, если рано или поздно она обратится к тебе за помощью, $n.', '', 54630),
(256618, 'ruRU', 'Теперь мы знаем, что Предвестница – это Ксал\'атат, существо из Бездны. Некогда ее дух был заточен в кинжале, но недавно она выбралась оттуда. И, похоже, не теряет времени даром.\n\nКсал\'атат сговорилась с Иридикроном и получила могущественную реликвию – Темное сердце. Она использует этот артефакт, и тому есть доказательства. Но зачем – неизвестно. Кроме того, ей подчиняются порождения Бездны, и она уже натравила их на Телогрус, который вы с Аллерией успешно отстояли.\n\nУвы, мы до сих пор не знаем, на что способно Темное сердце. Зато выяснили кое-что о Сияющей Песни... и теперь я опасаюсь худшего.', '', 54630),
(256616, 'ruRU', 'Насколько нам известно, жителям всего Азерота начало являться некое видение, светлое и благодатное. Но больше мы, увы, ничего не знаем. Что значит эта Песнь? Загадка.\n\nДжайна согласилась провести расследование. Если она что-нибудь обнаружит, я сразу тебе сообщу.', '', 54630),
(256615, 'ruRU', 'К несчастью, тут я и сам почти ничего не знаю. \n\nЭто союзница Иридикрона и сейчас Темное сердце – у нее. Нетрудно предположить, что мы имеем дело с сильным врагом, который наверняка замыслил что-то опасное.\n\nВот почему я попросил вас с Аллерией выяснить про нее все, что получится. Кто она? Зачем ей понадобилось сердце? Надеюсь, мы найдем ответы до того, как случится что-нибудь ужасное. Ее надо остановить.', '', 54630),
(256614, 'ruRU', 'Темное сердце – это реликвия, которая некогда хранилась в Запретном краю. Мы думаем, оно походило на Душу Дракона. Быть может, это прототип, который не подошел Смертокрылу.\n\nИридикрон выкрал Темное сердце и сбежал в далекое прошлое с помощью народа Бесконечности. Прямиком во времена, когда миром правили изначальные драконы, и Аспекты еще не стали Аспектами. Там он напитал артефакт мощью Галакронда – могущественного дракона, который едва не пожрал целый мир.\n\nТак Темное сердце и стало той самой грозной реликвией, которую мы знаем. Но Иридикрон не стал хранить сердце у себя, а отдал союзнице. Мы ее никогда не видели. Знаем лишь, что ее называют Предвестницей.', '', 54630),
(256293, 'ruRU', 'Прошлый интендант вел подсчеты в книге, а я предпочитаю дубину.', '', 54630),
(256290, 'ruRU', '', 'Драконы Бесконечности, сюда! Надо прижечь эту рану!', 54630),
(255818, 'ruRU', 'Потрясающе. Просто потрясающе.', '', 54630),
(255817, 'ruRU', 'Не задерживайся.', '', 54630),
(255816, 'ruRU', 'Плоть ненадежна. Сила вечна.', '', 54630),
(255815, 'ruRU', 'Я представляю... альтернативную силу.', '', 54630),
(255814, 'ruRU', 'Это как посмотреть.', '', 54630),
(255813, 'ruRU', 'Постарайся не тратить время зря.', '', 54630),
(255812, 'ruRU', 'Осторожно. Мне подвластны силы, недоступные твоему пониманию.', '', 54630),
(255811, 'ruRU', 'Да, у меня есть имя. Но тебе лучше его не знать.', '', 54630),
(255810, 'ruRU', 'Стоит только произнести мое имя вслух, как тут же откроются тысячи порталов Бездны. И все ее создания придут, чтобы собрать старые долги.', '', 54630),
(255809, 'ruRU', 'Так что если ты хочешь, чтобы ткань реальности разорвало в клочья, можешь еще раз спросить, как меня зовут.', '', 54630),
(255808, 'ruRU', 'Даю подсказку: это очень древнее слово силы. Если я шепну его тебе на ухо, то ты сразу сойдешь с ума. Попробуем?', '', 54630),
(255757, 'ruRU', 'Осторожно! Чем меньше огонь, тем быстрее он угасает.', '', 54630),
(255752, 'ruRU', 'Спасибо. Я...я...об этом подумаю.', '', 54630),
(255751, 'ruRU', 'Не обязательно отвечать сейчас. Насладись торжеством. Но знай, что для тебя всегда найдется место рядом со мной. Если ты захочешь.', '', 54630),
(255750, 'ruRU', 'Велен, я...', '', 54630),
(255749, 'ruRU', 'Послушай... давай служить нашему народу вместе, как раньше. Нам... мне вновь нужна твоя мудрость.', '', 54630),
(255748, 'ruRU', 'Хатуун, ты всегда был лучшим из нас. Мне не хватало твоих советов.', '', 54630),
(255747, 'ruRU', 'И правда. Знай мы тогда то, что знаем сейчас...', '', 54630),
(255746, 'ruRU', 'А еще... мы были молоды и наивны.', '', 54630),
(255745, 'ruRU', 'Когда-то мы доверяли друг другу...', '', 54630),
(255744, 'ruRU', 'Некоторые раны так быстро не заживают. Хотя... Аргус – он слишком далеко отсюда... и будто в другой жизни.', '', 54630),
(255743, 'ruRU', 'Действительно... Но в этот знаменательный день я надеялся, что мы помиримся. И сможем вернуть взаимное доверие.', '', 54630),
(255742, 'ruRU', 'Неужели? По-моему, у тебя все разговоры о чем-то очень важном.', '', 54630),
(255741, 'ruRU', 'Да, конечно. Надо обсудить кое-что очень важное.', '', 54630),
(255740, 'ruRU', 'Ты хотел поговорить со мной, Велен?', '', 54630),
(255739, 'ruRU', 'Саргерит? Ну, если ты считаешь, что это поможет...', '', 54630),
(255727, 'ruRU', '', '<вскрики>', 54630),
(255726, 'ruRU', '<боевой клич>', '', 54630),
(255725, 'ruRU', '<хрипит от боли>', '', 54630),
(255690, 'ruRU', 'Порча... поглотит тебя... да...', '', 54630),
(255687, 'ruRU', 'Кровь твою выпью!', '', 54630),
(255686, 'ruRU', 'Беги! Ха-ха-ха! Беги!', '', 54630),
(255685, 'ruRU', 'Порву на части!', '', 54630),
(255684, 'ruRU', 'Нет! <хрипит>', '', 54630),
(255683, 'ruRU', 'Вы не избавитесь от Скверны!', '', 54630),
(255680, 'ruRU', 'Ты... все равно... умрешь!', '', 54630),
(255679, 'ruRU', 'Это еще не конец!', '', 54630),
(255678, 'ruRU', 'Я... убит...', '', 54630),
(255676, 'ruRU', 'Склонись перед Скверной!', '', 54630),
(255675, 'ruRU', 'Все непрошенные гости умрут!', '', 54630),
(255674, 'ruRU', 'И-нок крайул!', '', 54630),
(255641, 'ruRU', '', 'Когда принесу Сердце.', 54630),
(255640, 'ruRU', '', 'Скоро свидимся, Кадгар.', 54630),
(255639, 'ruRU', 'Прости, я не...', '', 54630),
(255638, 'ruRU', 'Э-э...', '', 54630),
(255637, 'ruRU', '<вздыхает>', '', 54630),
(255636, 'ruRU', 'Бездна или нет, ты все та же Аллерия.', '', 54630),
(255635, 'ruRU', '', 'Что ж, мне как раз надо развеяться.', 54630),
(255633, 'ruRU', '', 'Выследить врага, о котором ничего не известно?', 54630),
(255632, 'ruRU', 'Вот почему мне нужна ты.', '', 54630),
(255631, 'ruRU', 'остается загадкой.', '', 54630),
(255630, 'ruRU', 'Кто она и что замышляет...', '', 54630),
(255629, 'ruRU', 'Предвестницы.', '', 54630),
(255628, 'ruRU', 'Известно лишь, что сейчас оно в руках некой...', '', 54630),
(255627, 'ruRU', 'Мы до сих пор не знаем, на что способно это Темное сердце...', '', 54630),
(255626, 'ruRU', 'Вообще-то из-за связи с Бездной я и позвал тебя сюда.', '', 54630),
(255625, 'ruRU', '<прочищает горло>', '', 54630),
(255624, 'ruRU', 'Это было бы... Кхм...', '', 54630),
(255623, 'ruRU', 'Бездна.', '', 54630),
(255622, 'ruRU', 'Ах да...', '', 54630),
(255621, 'ruRU', '', 'Мне... лучше к ним не приближаться.', 54630),
(255620, 'ruRU', '', '<вздыхает>', 54630),
(255618, 'ruRU', '', 'Я не...', 54630),
(255616, 'ruRU', 'Как семья?', '', 54630),
(255615, 'ruRU', 'Настолько, насколько возможно.', '', 54630),
(255614, 'ruRU', '', 'Все хорошо?', 54630),
(255613, 'ruRU', '', 'Рада встрече, Кадгар.', 54630),
(255612, 'ruRU', 'Как давно мы не виделись!', '', 54630),
(255611, 'ruRU', 'Аллерия!', '', 54630),
(255608, 'ruRU', '', 'Что узнаю, сообщу.', 54630),
(255607, 'ruRU', '', 'Кто-то должен знать о ней.', 54630),
(255606, 'ruRU', 'И Совет не знает, что это такое.', '', 54630),
(255605, 'ruRU', 'Ее слышат по всему Азероту.', '', 54630),
(255603, 'ruRU', '', 'Но эта... \"Сияющая Песнь\" – иное.', 54630),
(255602, 'ruRU', '', 'Мой народ и раньше слышал голоса из глубин...', 54630),
(255489, 'ruRU', 'Ха-ха-ха! Захотелось немного пошалить?', '', 54630),
(255487, 'ruRU', 'Пусть Свет наставляет тебя во всем.', '', 54630),
(255486, 'ruRU', 'Антейон акор кора!', '', 54630),
(255485, 'ruRU', 'Мы расстаемся друзьями.', '', 54630),
(255483, 'ruRU', 'Тебе нужен мой совет?', '', 54630),
(255482, 'ruRU', 'Храни тебя Свет.', '', 54630),
(255481, 'ruRU', 'Приветствую старых друзей и новых!', '', 54630),
(255480, 'ruRU', '', 'Что-то мне вдруг захотелось бросить гражданское проектирование и заняться разработкой оружия.', 54630),
(255478, 'ruRU', '', 'Мечтаешь о светлом будущем? Тогда возьми и создай его.', 54630),
(255477, 'ruRU', '', 'Потом как-нибудь поговорим.', 54630),
(255476, 'ruRU', '', 'Что, уже уходишь?', 54630),
(255474, 'ruRU', '', 'Да, да... Аркенон порос.', 54630),
(255473, 'ruRU', '', 'Эх! Ну вот, опять. Такую мысль упустила из-за этих глупых любезностей...', 54630),
(255472, 'ruRU', '', 'Я высший механолог. И это значит, что я всегда занята.', 54630),
(255471, 'ruRU', 'Помогать Атаании не всегда простая задача. Правда. Но это подготовит меня к должности механолога. Алмазы рождаются лишь при сильном давлении...', '', 54630),
(255469, 'ruRU', 'Меня ждут дела.', '', 54630),
(255468, 'ruRU', 'Ты уходишь? Но я так и не рассказал о моем исследовании!', '', 54630),
(255467, 'ruRU', 'Береги себя! Дайонисс ака!', '', 54630),
(255465, 'ruRU', 'Аркенон порос! Удачи и всех благ!', '', 54630),
(255464, 'ruRU', 'Надеюсь, мои исследования послужат моему народу.', '', 54630),
(255463, 'ruRU', 'Возможно, и я когда-нибудь стану высшим механологом.', '', 54630),
(255462, 'ruRU', 'Одна вечная пытка сменилась на другую...', '', 54630),
(255460, 'ruRU', 'Не верь незнакомцам, обещающим власть и силу.', '', 54630),
(255459, 'ruRU', 'Пусть мудрость направляет тебя.', '', 54630),
(255458, 'ruRU', 'Мы тысячи лет убивали своих собратьев. Возможно, еще больше времени уйдет на искупление.', '', 54630),
(255456, 'ruRU', 'Не нужно бояться.', '', 54630),
(255455, 'ruRU', 'Да? Что такое?', '', 54630),
(255454, 'ruRU', 'Я слушаю тебя.', '', 54630),
(255442, 'ruRU', 'Наконец-то мы обретем свой дом.', '', 54630),
(255441, 'ruRU', 'Мы построим наш новый город на старом пепелище.', '', 54630),
(255440, 'ruRU', 'Мы больше не будем жить порознь, оплакивая Аргус.', '', 54630),
(255439, 'ruRU', '...чтобы встретить будущее!', '', 54630),
(255438, 'ruRU', 'нам надо отпустить наше прошлое...', '', 54630),
(255437, 'ruRU', 'его суть осталась прежней:', '', 54630),
(255436, 'ruRU', 'в новом месте, много лет спустя,', '', 54630),
(255435, 'ruRU', 'Но даже здесь,', '', 54630),
(255434, 'ruRU', 'Немногие из нас его помнят.', '', 54630),
(255433, 'ruRU', 'Предыдущий был очень давно.', '', 54630),
(255432, 'ruRU', 'Для многих это будет первый Тишамаат.', '', 54630),
(255431, 'ruRU', 'Скажи пророку, что мы избавились от тягот. Начнем же церемонию!', '', 54630),
(255393, 'ruRU', 'А не сможешь... то Азерот, считай, уже обречен.', '', 54630),
(255392, 'ruRU', 'Ты должна стать сама собой, Аллерия.', '', 54630),
(255391, 'ruRU', 'Вот как? В тебе нет равновесия.', '', 54630),
(255390, 'ruRU', '', 'Я знаю, кто я.', 54630),
(255389, 'ruRU', 'Принять настоящую себя.', '', 54630),
(255388, 'ruRU', 'Но ты должна отпустить этот страх.', '', 54630),
(255387, 'ruRU', 'Да. Она знает, что больше всего ты боишься навредить родным.', '', 54630),
(255386, 'ruRU', '', 'Мне не справиться...', 54630),
(255385, 'ruRU', '', 'Я? Но ей известно мое самое слабое место.', 54630),
(255384, 'ruRU', 'Ты... должна ее остановить.', '', 54630),
(255383, 'ruRU', 'Боюсь, именно это она и замышляет.', '', 54630),
(255381, 'ruRU', 'Ага... Эти выброшенные вещи никому не нужны, но Джани знает им цену.', '', 54630),
(255380, 'ruRU', 'Ненужные вещи считают мусором. Мы знаем, что это не так.', '', 54630),
(255374, 'ruRU', '', '...что Ксал\'атат готовит такую же участь для Азерота?', 54630),
(255373, 'ruRU', '', 'Что? Ты ведь не думаешь...', 54630),
(255372, 'ruRU', '...перед тем как наш мир поглотил повелитель Бездны Пространствус.', '', 54630),
(255371, 'ruRU', 'Видения, о которых ты говорила, являлись также и моему народу...', '', 54630),
(255370, 'ruRU', '', 'Хватит на сегодня загадок...', 54630),
(255369, 'ruRU', 'Теперь ясно, почему она зовет себя Предвестницей.', '', 54630),
(255368, 'ruRU', 'Значит, Ксал\'атат получила Темное сердце...', '', 54630),
(255296, 'ruRU', 'Возможно, Атаания не готова к ритуалам Тишамаата. Но... мы попробуем ей помочь.', '', 54630),
(255294, 'ruRU', 'Ее отец, экзарх Хатаару, погиб при осаде. И ей до сих пор тяжело о нем вспоминать.', '', 54630),
(255293, 'ruRU', 'Тишамаат – это воспоминания о прошлом и прощание с ним.', '', 54630),
(255292, 'ruRU', 'Этого я и боялся. Тут дело не в работе... а в самом празднике.', '', 54630),
(255290, 'ruRU', 'Уничтожь видение! Оно не даст тебе расколоть идола!', '', 54630),
(255287, 'ruRU', '', 'И больше не являйтесь!', 54630),
(255286, 'ruRU', '', 'Прочь, силы смерти!', 54630),
(255285, 'ruRU', '', 'Все готово. Начинаем.', 54630),
(255284, 'ruRU', 'Сокровищница Джани – скорейший путь домой.', '', 54630),
(255282, 'ruRU', 'Я чувствую, она здесь. Восстановим алтарь, и Луку вернется.', '', 54630),
(255280, 'ruRU', 'Ты как раз вовремя.', '', 54630),
(255279, 'ruRU', 'Вот тебя-то я и ждал!', '', 54630),
(255278, 'ruRU', 'Рад тебя видеть.', '', 54630),
(255277, 'ruRU', 'Твоя помощь незаменима.', '', 54630),
(255276, 'ruRU', 'Хорошо, что ты на нашей стороне.', '', 54630),
(255275, 'ruRU', 'Удачи, дружище.', '', 54630),
(255274, 'ruRU', '', 'Моя работа требует точности! Мне тут не нужны неуклюжие дилетанты!', 54630),
(255273, 'ruRU', '', 'Джани любит не такие дары, как другие лоа. Тут нужно подумать.', 54630),
(255266, 'ruRU', 'А мы с ним закончили!', '', 54630),
(255265, 'ruRU', '', 'Мве\'зала еще не закончил с Черным Копьем.', 54630),
(255225, 'ruRU', 'Единственный способ защитить Азерот от теней – это изучать Бездну. Вот почему мы неустанно трудимся.', '', 54630),
(255201, 'ruRU', 'Однако она же позволяет нам защищать Азерот, как никто другой. Оберегать наш дом от Тьмы.', '', 54630),
(255200, 'ruRU', 'Сила Бездны способна разрушить целые миры.', '', 54630),
(255199, 'ruRU', 'Путь рен\'дорай труден и опасен. Темные голоса будут постоянно искушать нас, грозя поглотить.', '', 54630),
(255198, 'ruRU', 'Аллерия обязательно к нам вернется. В свое время. А пока обратитесь к мудрости Странника.', '', 54630),
(255197, 'ruRU', 'Она нужна Телогрусу. Кто будет нас наставлять?', '', 54630),
(255196, 'ruRU', 'О! Боюсь, сейчас... она выполняет собственное задание.', '', 54630),
(255195, 'ruRU', '', 'Госпожа Ветрокрылая возглавит дальнейшую разведку?', 54630),
(255194, 'ruRU', 'Однако ваша задача не изменилась. Продолжайте реагировать на необычную активность Бездны.', '', 54630),
(255191, 'ruRU', 'Судя по всему, Темное сердце способно преобразовывать магическую энергию в силу Тьмы.', '', 54630),
(255190, 'ruRU', 'Аллерии удалось кое-что узнать о странном явлении, которое вы изучаете.', '', 54630),
(255179, 'ruRU', 'Поспеши. Можешь взять мой голографит.', '', 54630),
(255034, 'ruRU', 'Все считают Аллерию лучшей ученицей Странника. На самом деле ей просто повезло стать его первой ученицей. Многие способны ее превзойти. Например, тот, с кем ты сейчас беседуешь.', '', 54630),
(255032, 'ruRU', '<Красный дракон смотрит на вас и ждет. Он готов протянуть крыло помощи.>', '<Красный дракон смотрит на вас и ждет. Он готов протянуть крыло помощи.>', 54630),
(254979, 'ruRU', 'Спасибо тебе, $n. С нетерпением жду, когда мы возьмемся за новые раскопки и раскроем все тайны истории!', '', 54630),
(254978, 'ruRU', 'Увы, история не сохранила название фолианта, который понадобился Нелтариону, однако наш сюжет можно считать законченным. Я чувствую, как стал ближе к своей героине – Синдрагосе!', '', 54630),
(254977, 'ruRU', 'Чудовище получило страшные раны – такие мог нанести только большой дракон. Вроде Синдрагосы.', '', 54630),
(254976, 'ruRU', 'Она встретила Нелтариона у Лазурных архивов и убедилась, что книга, за которой он охотился, в безопасном месте, где он до нее не доберется. И когда она это выяснила, то сразу прилетела на выручку нашим героям.', '', 54630),
(254975, 'ruRU', 'В живых остались только они двое – и они сдерживали чудище, пока не пришла подмога. Подмога в лице самой Синдрагосы.', '', 54630),
(254974, 'ruRU', 'Итак, теперь мы знаем, что случилось с Умтилой и Эберетом.', '', 54630),
(254966, 'ruRU', 'Неясно, что ее в конце концов прикончило. Но думаю, мы раскроем эту тайну! За работу, друзья!', '', 54630),
(254965, 'ruRU', 'Предатели смяли ряды драконов, и двухголовая тварь Нелтариона осталась жива.', '', 54630),
(254964, 'ruRU', 'Но, похоже, наш перебежчик долго не протянул: погиб в первые минуты битвы. Рядом с его останками мы нашли костяной кинжал Умтилы. Однако мы до сих пор не знаем, какая судьба постигла двух других героев.', '', 54630),
(254963, 'ruRU', 'Он-то и отвечает за поворот – потому что отвернулся от своих и перешел к Нелтариону. Когда появился протодракон, Гаррин со своим отрядом напал на воинов Эберета и Умтилы!', '', 54630),
(254962, 'ruRU', 'Роска отыскала тело Гаррина, нашего так называемого героя-джарадина.', '', 54630),
(254961, 'ruRU', 'Наша история совершила внезапный поворот! Тут имело место предательство!', '', 54630),
(254951, 'ruRU', 'Кхм! Но все же мы пока не знаем, как наши герои одержали победу! Пора снова надевать очки, рыться в бумагах и браться за лопаты!', '', 54630),
(254950, 'ruRU', 'И представь себе, $n, мне в руки попала бумага, которую написала сама Синдрагоса! Ах, у меня чуть сердце снова не забилось!', '', 54630),
(254949, 'ruRU', 'Она не знала, какую именно, но кое-что подозревала. Синдрагоса боялась, что нападение на Удел Предателя – это простой отвлекающий маневр, и все же не могла полагаться на случай.', '', 54630),
(254948, 'ruRU', 'Кажется, Синдрагоса узнала, что Нелтарион собирался украсть из архивов какую-то важную книгу.', '', 54630),
(254947, 'ruRU', 'Зацепки указывают на то, что сюда доставили какие-то артефакты из Лазурных архивов, а потом отправили их дальше – чтобы сберечь.', '', 54630),
(254857, 'ruRU', 'Что ж, если находки не врут, у нашей истории счастливый конец.', '', 54630),
(254855, 'ruRU', 'Почему я этого раньше не замечал? Такое мог сотворить только дракон!', '', 54630),
(254854, 'ruRU', 'Ага! Значит, они все-таки выжили!', '', 54630),
(254852, 'ruRU', 'А вот и старый враг, тут как тут. Я мог бы догадаться, что мы его здесь найдем...', '', 54630),
(254851, 'ruRU', 'Возможно, эта зацепка подскажет, почему это место назвали Уделом Предателя.', '', 54630),
(254850, 'ruRU', 'Хм, кажется, далеко не все у них шло по плану!', '', 54630),
(254847, 'ruRU', 'Умно, ничего не скажешь. Что бы тут ни находилось, они перевезли это в безопасное место. Хм...', '', 54630),
(254846, 'ruRU', 'Хм, они не только защищались от протодракона, но и что-то сохраняли.', '', 54630),
(254845, 'ruRU', 'Похоже, здесь была какая-то суматоха. И что-то передвигали, очень осторожно!', '', 54630),
(254824, 'ruRU', 'Кажется, тут развернулась целая сага, $n! Сага, достойная войти в легенды. В ней было все: война, благородные герои, злодеи, романтика – и тайны!', '', 54630),
(254785, 'ruRU', 'Нам с Джайной надо обсудить все, что тебе удалось выяснить.\n\nЕсли хочешь, присоединяйся.', '', 54630),
(254783, 'ruRU', 'Темное сердце и Предвестница... Похоже, настают темные времена. Бедам нет ни конца ни края. \n\nХорошо, что мне всегда есть на кого положиться. Я, конечно, говорю о тебе, $n.', '', 54630),
(254774, 'ruRU', '', 'Пусть твои карманы всегда будут полны!', 54630),
(254773, 'ruRU', '', 'Удачи тебе!', 54630),
(254771, 'ruRU', '', 'Освистать всех наверху!.. Или как там?..', 54630),
(254770, 'ruRU', '', 'Я всегда рада новым знакомствам!', 54630),
(254763, 'ruRU', 'Праздник выбора облика не может обойтись без драконов.', '', 54630),
(254762, 'ruRU', '', 'Не уверена, что понимаю, как выбирать себе облик...', 54630),
(254760, 'ruRU', '', 'Вот бы устроить драктирам свой праздник в честь выбора облика!', 54630),
(254697, 'ruRU', 'Мне нужное многое с вами обсудить.\n\nА именно Ксал\'атат, которую теперь называют Предвестницей. И Сияющую Песнь, которую слышит весь Азерот.', '', 54630),
(254626, 'ruRU', 'Бездна дарует безграничные возможности.', '', 54630),
(254624, 'ruRU', 'Никогда не теряй контроль над собой.', '', 54630),
(254623, 'ruRU', 'Что, в пираты податься захотелось?', '', 54630),
(254621, 'ruRU', 'Голоса не властны надо мной.', '', 54630),
(254620, 'ruRU', 'Скоро увидимся... очень скоро.', '', 54630),
(254619, 'ruRU', 'Мы сами вершим свою судьбу.', '', 54630),
(254618, 'ruRU', 'Не помри, пока я золото не получу!', '', 54630),
(254617, 'ruRU', '', 'Даже во тьме есть сила.', 54630),
(254614, 'ruRU', '', 'Шорель-аран.', 54630),
(254613, 'ruRU', 'Хочется полные карманы набить?', '', 54630),
(254608, 'ruRU', 'Для нас открыты новые пути.', '', 54630),
(254603, 'ruRU', 'Вселенная полна загадок.', '', 54630),
(254600, 'ruRU', 'Сомневайся во всем.', '', 54630),
(254598, 'ruRU', 'Мы сражаемся за будущее. Наше будущее.', '', 54630),
(254596, 'ruRU', '', 'Выбери свой путь.', 54630),
(254595, 'ruRU', '', 'Баладаш, маланоре.', 54630),
(254580, 'ruRU', '', 'Большинству предметов требуются для улучшения драконьи камни, так что лучше их поискать.\n\nЧтобы улучшить снаряжение искателей приключений, ветеранов, чемпионов, героев или легендарных героев, дополнительно потребуются пробужденные гребни. Для каждого улучшения нужно пятнадцать гребней соответствующего уровня. Казолт или другой специалист по улучшению расскажет, какие именно. \n\nЕсли предмет слабее, чем такое же твое снаряжение, его можно улучшить за полцены – то есть половину драконьих камней, а гребни и вовсе не понадобятся. К примеру, у тебя уже есть мощный плащ. И тут ты находишь другой плащ, слабее. Можешь прийти к специалисту и улучшить его за сущий бесценок!', 54630),
(254578, 'ruRU', '', 'Драконьи камни встречаются повсюду на Драконьих островах. Их можно найти среди сокровищ или получить, выполняя локальные задания, участвуя в еженедельных событиях, проходя подземелья и рейды.\n\nПробужденные гребни добываются таким же образом. Они бывают четырех уровней. Если хочешь достать самые мощные, придется преодолеть опасные и трудные испытания.', 54630),
(254511, 'ruRU', '', 'О, привет!\n\nМы с Казолтом старательно изучаем драконьи камни и эти новые пробужденные гребни, которые появляются на островах тут и там. Казолот знает, как с ними обращаться, и поможет тебе улучшить снаряжение. Ну а я пока экспериментирую с трансмутацией гребней.\n\nКажется, наши новые находки черпают силу напрямую от островов! Вот так чудеса!', 54630),
(254373, 'ruRU', '', 'Профилактический отказ генератора? Так бывает?', 54630),
(254371, 'ruRU', '', 'Почему ты все еще здесь?\n\nБеруун и так не может сосредоточиться. Не отвлекай его.', 54630),
(254370, 'ruRU', '', 'Все очищено!', 54630),
(254361, 'ruRU', 'Это значит выбрать рабство и смерть.', '', 54630),
(254360, 'ruRU', '', 'Из его хватки не вырваться. Будет лучше, если вы подчинитесь Мве\'зале.', 54630),
(254359, 'ruRU', 'Что такое ты говоришь!', '', 54630),
(254358, 'ruRU', '', 'Уже слишком поздно. Сейчас я отдам эти жизни Мве\'зале.', 54630),
(254353, 'ruRU', '', 'Бездна открывает перед нами все пути.\n\nПо крайней мере, так нам говорят. Мне еще далеко до полного познания Бездны, но даже я понимаю, что один Свет не сможет защитить нас в будущем.\n\nНе теряй веру и открой сердце всем источникам силы.', 54630),
(254352, 'ruRU', 'Я научился не бояться голосов. Они для меня как... непоседливые приятели. Совсем безобидные, если не давать им воли.', '', 54630),
(254351, 'ruRU', '', 'А я ведь когда-то была разрушительницей чар. Могла развеять любую магию и снять любое проклятие. Пока... не стала такой. \n\nЭто единственные чары, которые я не в силах разрушить. Забавно, не правда ли?', 54630),
(254348, 'ruRU', '<Блочиний следит за вами, не отрывая взгляда. Его взор становится еще более пристальным каждый раз, когда вы приближаетесь к госпоже Мракодол.>', '', 54630);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(254335, 'ruRU', 'Друзья, собратья! Прошу вашего внимания. Церемония скоро начнется.', '', 54630),
(254334, 'ruRU', '<Нобундо опускает камень в чашу.>\n\nМы никогда не сдадимся... сдаваться нельзя.\n\nБудущее принесет именно то, в чем ты нуждаешься. Надо только его дождаться и принять.', '', 54630),
(254333, 'ruRU', '<Акама опускает камень в чашу.>\n\nЯ много страдал в своих странствиях.\n\nВозможно, пришла пора вернуться.', '', 54630),
(254332, 'ruRU', '', '<Найель опускает камень в чашу.>\n\nПоследние десять лет одиночества... тяжело мне давались. Но я сама выбрала такую судьбу.\n\nСпасибо тебе за Тишамаат. За помощь.\n\nОн нам очень нужен. Он нужен мне.', 54630),
(254331, 'ruRU', '<Арзаал опускает камень в чашу.>\n\nЧтобы описать все, о чем я сожалею, не хватит и целой горы.\n\nНо, по крайней мере, я сделал хоть что-то. Каждый день нужно делать хоть что-то.', '', 54630),
(254330, 'ruRU', '<Борос опускает камень в чашу.>\n\nЯ много раз помогал дренеям начать все заново, но этот случай – особый.\n\nНа сей раз ничто не закончилось и не рухнуло. Только померкло в лучах рассвета.', '', 54630),
(254329, 'ruRU', '', '<Ишана опускает камень в чашу.>\n\nСвет усмиряет всякие страдания, успокаивает всякое горе.\n\nНельзя забывать укус, из-за которого остался шрам, но можно укротить боль воспоминаний.', 54630),
(254328, 'ruRU', '<Хатуун швыряет камень в чашу.>\n\nУнеси.', '', 54630),
(254327, 'ruRU', '<Велен опускает камень в чашу.>\n\nВ твоих руках – не просто церемониальная чаша.\n\nВ твоих руках – наша боль и надежда. Наши сожаления и наша сила.\n\nТы держишь самую суть дренейского народа.\n\nНеси ее бережно и с гордостью.', '', 54630),
(254314, 'ruRU', '<Ромуул опускает камень в чашу.>\n\nВечный прогресс – вперед и ввысь! Вот зачем тысячи лет назад основали орден механологов.\n\nС каждым шагом мы отталкиваемся от ступени, на которую некогда взошли. И эту ступень нельзя забывать.', '', 54630),
(254310, 'ruRU', '', '<Атаания опускает камень в чашу.>\n\nЭто архитектурное чудо станет вершиной механологии.\n\nДаже \"Виндикар\" будет выглядеть, как детская игрушка, в сравнении с тем, что мы сделаем все вместе.\n\nДаю слово.', 54630),
(254299, 'ruRU', 'Жертвуя своими? Зачем нам такая сила?', '', 54630),
(254298, 'ruRU', '', 'Черное Копье обретет силу!', 54630),
(254297, 'ruRU', '', 'Идем. Надо уничтожить идолов.', 54630),
(254295, 'ruRU', 'Это займет время, но я укреплю оружие вождя Рокхана. Он будет готов к битве.\n\nКажется, Джани задумал что-то на твой счет.', '', 54630),
(254294, 'ruRU', 'Особую штуковину, которая тебя защитит. Она где-то здесь.\n\nЕсли сражаться на высоте, то можно упасть и переломать все кости. Было бы здорово не ломать кости, правда?\n\nНу вот, я испортил сюрприз! Когда я найду штуковину, притворись, будто это все еще сюрприз, ладно?', '', 54630),
(254259, 'ruRU', 'А пока обсудим твое расследование.', '', 54630),
(254252, 'ruRU', 'Хорошо запомните это. И тогда сохраните свой разум.', '', 54630),
(254251, 'ruRU', 'Только тогда вам станет подвластна каждая крупица ее силы.', '', 54630),
(254249, 'ruRU', 'Встать в очередь на \"Арену Истребления\".', 'Встать в очередь на \"Арену Истребления\".', 54630),
(254222, 'ruRU', 'Возьми эту чашу и собери у всех камни воспоминаний. Предай их Огню Отдохновения. И развей наши тяготы.', '', 54630),
(254219, 'ruRU', 'Вверяю тебе долг тишатаана, хранителя воспоминаний на Тишамаате. Это очень важная роль.', '', 54630),
(254130, 'ruRU', 'Нашел! Это спасет, если упадешь.', '', 54630),
(254127, 'ruRU', '', 'Пора сразиться с Мве\'залой!\n\nЕсли понадобится, мои листовики помогут тебе перемещаться с платформы на платформу.\n\nХочешь наверх?', 54630),
(254090, 'ruRU', 'Не растеряй ясность ума.', '', 54630),
(254089, 'ruRU', 'Прими Бездну – или она поглотит тебя.', '', 54630),
(254088, 'ruRU', 'Полностью погрузись во тьму.', '', 54630),
(254087, 'ruRU', 'Поглотит ли тебя Бездна?', '', 54630),
(254053, 'ruRU', 'Мы найдем ее.', '', 54630),
(254052, 'ruRU', 'Луку...', '', 54630),
(254050, 'ruRU', 'Мы на месте, мастер Гадрин.', '', 54630),
(254049, 'ruRU', 'Я собрал всех, чтобы послушать, что Бвонсамди скажет Черному Копью.\n\nНам с вами придется действовать заодно.', '', 54630),
(254043, 'ruRU', '', 'Скорее за ним!', 54630),
(254041, 'ruRU', 'Я бы с удовольствием порассуждал с тобой о природе Бездны, но, боюсь, не привык говорить на такие темы с... неискушенными собеседниками. \n\nВряд ли тебе удастся угнаться за полетом моей мысли.', '', 54630),
(254040, 'ruRU', 'Ты отвергла Свет, Аллерия. И стала моим врагом.', '', 54630),
(254001, 'ruRU', '', 'Никакие неудачи нас не остановят.', 54630),
(254000, 'ruRU', '', 'Ступай.', 54630),
(253999, 'ruRU', '', 'До скорого.', 54630),
(253997, 'ruRU', '', 'Да хранят тебя духи.', 54630),
(253996, 'ruRU', '', 'Мы служим лоа.', 54630),
(253994, 'ruRU', '', 'За Черное Копье.', 54630),
(253993, 'ruRU', '', 'Помощь нужна?', 54630),
(253991, 'ruRU', 'Ну, я хотел, чтобы меня не забывали...', '', 54630),
(253982, 'ruRU', 'Не забывай.', '', 54630),
(253981, 'ruRU', 'Я буду следить.', '', 54630),
(253980, 'ruRU', 'Вернемся в тени.', '', 54630),
(253979, 'ruRU', 'Что замышляешь?', '', 54630),
(253977, 'ruRU', 'Тени слушают тебя.', '', 54630),
(253976, 'ruRU', 'Я тебя вижу.', '', 54630),
(253975, 'ruRU', '', 'Иногда боль – часть исцеления. Как жар, прогоняющий болезнь.', 54630),
(253967, 'ruRU', '', 'Иди, займись делом.', 54630),
(253965, 'ruRU', '', 'До завтра.', 54630),
(253964, 'ruRU', '', 'Теперь ступай.', 54630),
(253962, 'ruRU', '', 'Мы заполним вашу пустоту.', 54630),
(253946, 'ruRU', '', 'Здравствуй, дитя.', 54630),
(253945, 'ruRU', '', 'Я буду здесь. Всегда.', 54630),
(253732, 'ruRU', 'Как получишь это послание, сразу отправляйся в Экзодар! Нужна твоя помощь в очень важном деле!', '', 54630),
(253731, 'ruRU', 'Слышно? Так, голографит уже пишет? А? Да? Все, хорошо!', '', 54630),
(253695, 'ruRU', 'Эта трасса называется \"Хладаррские высоты\".\n \nДавным-давно Малигос перенаправил сюда все силовые линии с магией, из-за чего началась война Нексуса. С тех пор драконы уже давно помирились, но, как видишь, платформы так и висят в воздухе. Их поддерживает магия той старой войны. \n\nМы проложили непростую трассу: тебе придется то круто взлетать вверх, то падать вниз. Что поделать, эту крепость возвели далеко не с мирными целями, а значит, покоем тут и не пахнет.', 'Эта трасса называется \"Хладаррские высоты\".\n \nДавным-давно Малигос перенаправил сюда все силовые линии с магией, из-за чего началась война Нексуса. С тех пор драконы уже давно помирились, но, как видишь, платформы так и висят в воздухе. Их поддерживает магия той старой войны. \n\nМы проложили непростую трассу: тебе придется то круто взлетать вверх, то падать вниз. Что поделать, эту крепость возвели далеко не с мирными целями, а значит, покоем тут и не пахнет.', 54630),
(253666, 'ruRU', 'Мы называем эту трассу \"Спринт над Гундраком\".\n \nПочему спринт? Потому что ты здорово разгонишься, когда будешь пикировать с храмовых стен! Но все равно вряд ли наберешь скорость, с какой покатилась вниз империя Драккари. Они, знаешь ли, совершили большую глупость. Настолько большую, что этот храм с ней не сравнится.\n \nНо ладно, довольно разговоров. Я, конечно, могу бесконечно рассуждать о том, почему приносить в жертву своих богов – скверная идея. Но ты здесь ради гонки, а не ради разговоров.', 'Мы называем эту трассу \"Спринт над Гундраком\".\n \nПочему спринт? Потому что ты здорово разгонишься, когда будешь пикировать с храмовых стен! Но все равно вряд ли наберешь скорость, с какой покатилась вниз империя Драккари. Они, знаешь ли, совершили большую глупость. Настолько большую, что этот храм с ней не сравнится.\n \nЛадно, хватит болтать. Я могу долго рассуждать о том, почему приносить в жертву своих богов – скверная идея, но ты здесь ради гонки, в конце-то концов.', 54630),
(253664, 'ruRU', '', 'Мве\'зала не умеет драться честно.\n\nГотовься к тяжелой битве.', 54630),
(253569, 'ruRU', '', 'Мы встретим эту угрозу вместе. Орда и Альянс.', 54630),
(253568, 'ruRU', '', 'Я разыщу Магни. Но сначала сообщу обо всем Траллу.', 54630),
(253567, 'ruRU', 'Надо узнать. Нам нужен ее Вестник.', '', 54630),
(253566, 'ruRU', '', 'Значит... Азерот сама в опасности? Она говорит с нами?', 54630),
(253563, 'ruRU', 'Странник сказал, что эфириалы слышали подобное, перед тем как К\'ареш был уничтожен.', '', 54630),
(253562, 'ruRU', '', 'Это связано с Сияющей Песнью. Наверняка.', 54630),
(253561, 'ruRU', 'Ксал\'атат вернулась как Предвестница. Но теперь она еще получила силу Темного сердца.', '', 54630),
(253559, 'ruRU', '', 'Нет. Вестник Азерот давно не давал о себе знать.', 54630),
(253558, 'ruRU', 'Есть вести от Магни?', '', 54630),
(253552, 'ruRU', '', 'Расскажи все Кадгару. Я вернусь в Даларан позже.', 54630),
(253551, 'ruRU', '', 'Мне лучше уйти. Вы все в опасности, пока за мной наблюдает Ксал\'атат.', 54630),
(253548, 'ruRU', '', 'Пожалуйста. Я и так слишком здесь задержалась.', 54630),
(253547, 'ruRU', 'Убирайся отсюда прочь, Ксал\'атат!', '', 54630),
(253546, 'ruRU', '', 'Аллерия. Мягкое сердечко... никак их не отпустишь.', 54630),
(253545, 'ruRU', '', 'Я не могу!', 54630),
(253544, 'ruRU', 'Убей меня, Аллерия! Или Бездна не дала тебе сил?', '', 54630),
(253543, 'ruRU', '', 'Не смей говорить его голосом!', 54630),
(253542, 'ruRU', 'Так вот на что ты променяла Свет? Свою семью! Какая мерзость.', '', 54630),
(253541, 'ruRU', '', 'Впереди главная цель. Тот гнусный отголосок Туралиона.', 54630),
(253536, 'ruRU', '', 'Они поплатятся за то, что покусились на мой дом.', 54630),
(253532, 'ruRU', '', 'Нет! Такого никогда не было!', 54630),
(253531, 'ruRU', '<крики боли>', '', 54630),
(253530, 'ruRU', '', 'О, как же ты об этом жалеешь... Так пусть это чувство обретет плоть!', 54630),
(253529, 'ruRU', '', 'Понимаю. Но моя судьба не изменилась.', 54630),
(253527, 'ruRU', 'Ты связалась с силами зла... Да лучше бы я умер.', '', 54630),
(253520, 'ruRU', '', 'Мы на охоте. И дичь поджидает нас, оскалив пасть.', 54630),
(253503, 'ruRU', '', 'Я покинула родной мир и сына, чтобы уберечь их. То же самое касается Армии Света.', 54630),
(253501, 'ruRU', '', 'Я приняла Бездну. И не жалею об этом выборе.', 54630),
(253499, 'ruRU', '', 'Зе\'ра помогла мне с ним связаться. Но силы Света не хватило, чтобы одолеть Легион.', 54630),
(253498, 'ruRU', '', 'Тогда в последний раз я видела сына ребенком. Мой Аратор... Я благодарю судьбу за тот день.', 54630),
(253497, 'ruRU', '', 'Но, покинув родных... я не смогла их защитить. Как и умереть вместе с ними.', 54630),
(253496, 'ruRU', '', 'Отказ от звания предводительницы следопытов дался мне нелегко. Как и моей семье.', 54630),
(253495, 'ruRU', '', 'Зачем мне все это показывать? Что она задумала?', 54630),
(253494, 'ruRU', '', 'Это же... Эредат.', 54630),
(253441, 'ruRU', 'Хочешь узнать о Бездне? Ее шепот не только сводит с ума, но и многому может научить. \n\nНадо только внимательно слушать.', '', 54630),
(253440, 'ruRU', 'Ни в коем случае не отвергайте Бездну.', '', 54630),
(253439, 'ruRU', 'Вы должны полностью погрузиться в ее тьму. И принять ее истины.', '', 54630),
(253436, 'ruRU', 'Сама суть Бездны противоречит порядку, жизни, разуму.', '', 54630),
(253435, 'ruRU', 'Вы считаете Бездну врагом, а она – вас. Но это пока.', '', 54630),
(253240, 'ruRU', '', 'Вам нужно мое Темное сердце? Так придите. И заберите.', 54630),
(253238, 'ruRU', '', 'Тени поглотили ее. Защищайся!', 54630),
(253237, 'ruRU', '', 'Предвестница провозгласит новую эру для эльфов Бездны!', 54630),
(253235, 'ruRU', '', 'Этот голос...', 54630),
(253234, 'ruRU', '', 'О, наконец-то вы прибыли, мои дорогие гости.', 54630),
(253214, 'ruRU', 'Но это невозможно сделать без рабочего излучателя. Подключи кристаллы каронита. Надеюсь, это поможет.', '', 54630),
(252856, 'ruRU', '', 'Что ж, мы точно на верном пути…', 54630),
(252827, 'ruRU', '', 'Я пойду первой. Встретимся там.', 54630),
(252826, 'ruRU', '', 'Следы ведут на север. Постой... я что-то чувствую. В Ульдуаре?', 54630),
(252825, 'ruRU', '', 'Может быть, Темное сердце поглощает силу магии? Превращает ее во тьму?', 54630),
(252824, 'ruRU', '', 'Странники разломов сказали, был всплеск энергии Бездны. А потом затишье.', 54630),
(252822, 'ruRU', '', 'Галакронд потерял разум, не в силах насытиться. Именно этот страшный голод и усилил Темное сердце.', 54630),
(252821, 'ruRU', '', 'В глубинах Бездны нелегко отыскать свое предназначение. Многие рен\'дорай до сих пор блуждают в потемках. Но долг странницы разломов служит мне ориентиром. Он помогает двигаться дальше даже в самые отчаянные времена.', 54630),
(252820, 'ruRU', '', 'Следы. Может, их оставила странница. Идем по ним.', 54630),
(252812, 'ruRU', '', 'Зачем сюда проникла Бездна? И почему сейчас?', 54630),
(252810, 'ruRU', '', 'Хм... А вдруг пропажа странницы разломов... связана с Темным сердцем...', 54630),
(252809, 'ruRU', '', 'Уже доводилось беседовать со Странником? Он знает о Бездне больше, чем кто-либо другой. Нам очень повезло, что он решил поделиться своей мудростью.', 54630),
(252808, 'ruRU', 'Всплеск активности был на севере материка, но возле Зул\'Амана след оборвался.', '', 54630),
(252807, 'ruRU', 'Но когда я туда прибыл, то ничего не обнаружил. Никаких следов.', '', 54630),
(252806, 'ruRU', '', 'Сейчас там спокойно.', 54630),
(252743, 'ruRU', '', 'Здесь Иридикрон напитал Сердце энергией. Но... тысячи лет назад.', 54630),
(252730, 'ruRU', '', 'Я открою разлом. Следуй за мной.', 54630),
(252729, 'ruRU', 'Странница Нилара не вернулась из Нордскола. Это не к добру.', '', 54630),
(252728, 'ruRU', 'Орден странников разломов был создан, чтобы защищать Азерот от Бездны. Но это не значит, что каждый из нас способен противостоять ее шепоту... \n\nПоэтому нашему народу необходимо единство. Вместе мы сильнее.', '', 54630),
(252727, 'ruRU', 'Я изучал энергетические колебания в Восточных Королевствах.', '', 54630),
(252726, 'ruRU', 'Мой доклад совсем краток.', '', 54630),
(252725, 'ruRU', 'И изучить проявления Бездны на южном берегу.', '', 54630),
(252724, 'ruRU', 'Мне поручили отправиться в Калимдор.', '', 54630),
(252723, 'ruRU', '', 'В Аберрии была замечена странная вспышка энергии Бездны. Пока непонятно, что вызвало этот всплеск.', 54630),
(252722, 'ruRU', '', 'Я только что вернулась с Драконьих островов.', 54630),
(252721, 'ruRU', 'Вот как... Я сообщу об этом Страннику.', '', 54630),
(252720, 'ruRU', '', 'Его назвали Сияющей Песнью.', 54630),
(252719, 'ruRU', '', 'Есть еще кое-что... По всему Азероту наблюдают одно видение.', 54630),
(252717, 'ruRU', 'Поговорим о том, как не лишиться рассудка. Знайте, Бездна сделает все, чтобы сломить вас.', '', 54630),
(252716, 'ruRU', 'Да. Странники разломов как раз вернулись с разведки.', '', 54630),
(252715, 'ruRU', '', 'А рен\'дорай замечали всплески энергии Бездны?', 54630),
(252714, 'ruRU', '', 'Соберись и вперед.', 54630),
(252710, 'ruRU', '', 'Кадгар был очень серьезен, когда связался со мной. Пойдем, выслушаем его.', 54630),
(252709, 'ruRU', '', 'Кадгар сказал, что ты придешь. Я решила тебя дождаться.', 54630),
(252687, 'ruRU', 'Даже на Азероте демоны распоясались… вконец.', '', 54630),
(252678, 'ruRU', 'Встретимся в Палате Хранителя. Аллерия тоже скоро туда прибудет.', '', 54630),
(252677, 'ruRU', 'Нам снова требуется твоя помощь. Во мраке теней пробудилась новая загадочная угроза – Предвестница...', '', 54630),
(252662, 'ruRU', '', '<Атаания устало на вас смотрит.>\n\nЕсли скажешь еще хоть слово про этот Тишамаат, то очнешься под Возвышенностью Алдоров с отпечатком копыта пониже спины!', 54630),
(252658, 'ruRU', '', 'Убирайся.', 54630),
(252657, 'ruRU', '', 'Что? Я... ох...', 54630),
(252656, 'ruRU', 'Он был бы счастлив, видя, как ты делишься своими открытиями с остальными. А не сидишь одна взаперти...', '', 54630),
(252655, 'ruRU', 'Атаания! Это я попросил сделать. Хатаару не хотел бы, чтобы ты страдала.', '', 54630),
(252654, 'ruRU', '', 'Я просила тебя уйти, а не грабить могилу моего отца!', 54630),
(252653, 'ruRU', '', 'Ты в своем уме?', 54630),
(252640, 'ruRU', 'Атаания и вправду очень занята. Быть может, дело лишь в этом?\n\nНадеюсь, что так.', '', 54630),
(252635, 'ruRU', 'Возьми дар экзарха и отнеси его дочери. Это поможет им обоим.', '', 54630),
(252610, 'ruRU', 'Для обряда потребуются новые руш\'ки.', '', 54630),
(252561, 'ruRU', '', 'Теперь ждем.', 54630),
(252533, 'ruRU', 'Любовь – это все, что тебе нужно. Любовь и шоколад.', 'Любовь – это все, что тебе нужно. Любовь и шоколад.', 54630),
(252492, 'ruRU', 'Вол\'джин и знахарь Залазан искали совета лоа: хотели узнать, что сулит будущее.\n\nОни ушли в глубину лесов Первого Дома, и там лоа послали им испытание, которое дало ответы на все вопросы. Когда Залазан и Вол\'джин проснулись, они толком ничего не могли вспомнить, но зато знали, что нужно делать и как помочь племени Черного Копья.', '', 54630),
(252489, 'ruRU', 'Ученица! Ты как, цела?', '', 54630),
(252465, 'ruRU', 'Я просто посмотрю. У тебя все получится.', '', 54630),
(252460, 'ruRU', 'Кево превращается в тень и проникает куда угодно.\n\nДжани прыгает на кучи сокровищ.\n\nПопробуй и то, и другое. Тогда решишь, что лучше. Подсказываю: лучше сокровища.', '', 54630),
(252452, 'ruRU', 'Что удалось узнать? Кево йа Сити все никак не успокоится!', '', 54630),
(252451, 'ruRU', 'Лоа среди нас!', 'Лоа среди нас!', 54630),
(252428, 'ruRU', 'Обожаю Бамбалу. Джани – знаменитость!', '', 54630),
(252427, 'ruRU', 'Теперь, когда я снова увидел Кево йа Сити, я его узнаю!\n\nПрошло уже много лет, но я помню, что темные охотники поклонялись лоа хитрости. В нем воплотилось много того, чему мы пытаемся научиться.', '', 54630),
(252426, 'ruRU', 'Здесь, в Зул\'Гурубе, почитают многих лоа. Не все из них друзья Черному Копью.', '', 54630),
(252425, 'ruRU', 'Не люблю, когда из-за лоа смертные страдают.\n\nНо я – другое дело. Я-то всего лишь шутки шучу. И заодно учу уму-разуму.', '', 54630),
(252423, 'ruRU', 'Хитрый лоа слишком уж хитрый!', '', 54630),
(252413, 'ruRU', 'Кево йа Сити – хороший лоа. Хитрость – это важно. Надо быть умнее злодеев.\n\nПравда, Джани не любит, когда выскакивают из засады и пугают.', '', 54630),
(252412, 'ruRU', 'Я думаю, наш потерянный лоа охотится на жрецов из племени Хаккари. Это хорошо.\n\nЕсли он их не любит, то и с Мве\'залой не поладит.', '', 54630),
(252411, 'ruRU', 'Зул\'Гуруб – территория Гурубаши, а значит, жди неприятностей с Хаккари. Они почитают Хаккара, лоа крови, и приносят ему жертвы.\n\nСтарые лоа Черного Копья не любили кровь. Вряд ли они подружились с ним.', '', 54630),
(252375, 'ruRU', '', 'Мастер Гадрин подготовил все, что нужно.', 54630),
(252263, 'ruRU', 'Что, не получилось? Вот незадача...', '', 54630),
(252262, 'ruRU', 'Хорошо, что ты с нами, $n. У Бвонсамди для нас новости.', '', 54630),
(252260, 'ruRU', 'Но пророк намерен возродить священную традицию. И считает, что сейчас самое подходящее время.', '', 54630),
(252258, 'ruRU', 'Это день осмысления прошлого, извлечения из него полезных уроков и выбор пути вперед.', '', 54630),
(252256, 'ruRU', '', 'Когда вернетесь, проведем обряд испытаний.', 54630),
(252251, 'ruRU', 'Выходит, решили связаться с лоа? И что все это значит?\n\nУстали от Бвонсамди?\n\nХорошие сокровища, хорошие. Подходят Джани. Я рад. Задавай свои вопросы.', '', 54630),
(252243, 'ruRU', '', 'Джани! Точно! Надо чем-нибудь привлечь его внимание.', 54630),
(252242, 'ruRU', 'Проводник... А кто лучше всех находит пропажи? Лоа собирателей Джани.', '', 54630),
(252215, 'ruRU', '', 'Я в порядке. Давай ты попробуй.', 54630),
(252214, 'ruRU', 'Нам надо дождаться героя.', '', 54630),
(252210, 'ruRU', 'Наши тролли? Служат Мве\'зале? Герой! Уничтожь подношения!', '', 54630),
(252157, 'ruRU', '', 'Привет!\n\nСдается мне, ты интересуешься старинными ремесленными техниками! У меня тут целая КУЧА чертежей из прошлого сезона.\n\nЕсли захочешь купить парочку, дай знать!', 54630),
(252122, 'ruRU', 'Глянь. Как тут много мертвых слуг Хаккара...', '', 54630),
(252117, 'ruRU', 'Мве\'зала говорит с троллями из Черного Копья.', '', 54630),
(251881, 'ruRU', 'Опаздываешь! Беги к фамилиару и готовься \"взять врага за рога\"! Или как там...', '', 54630),
(251680, 'ruRU', 'Ступай с миром.', '', 54630),
(251661, 'ruRU', 'Кево йа Сити кивает.', '', 54630),
(251651, 'ruRU', 'Да. Из кристаллов создали распространителей Скверны. И сатиры тут ни при чем. Это работа ман\'ари. Я уверен.', '', 54630),
(251649, 'ruRU', 'Луку! Мы тебя искали! ', '', 54630),
(251643, 'ruRU', '', 'Мы с Кево йа Сити повздорили, когда Черное Копье ушло отсюда.\n\nИ Кево тоже ушел – в бешенстве. Он хотел дать сдачи темным лоа, таким как Мве\'зала и Хаккар. Они попортили многих троллей. Но я знала, что вы вернетесь. \n\nЯ ждала, ждала, и тут пришли огры. Нашли меня. Разбили святилище, отняли у меня силу своей магией. Я не умерла, но исцелиться не могла. И это было... невыносимо. Страшные муки. \n\nКево вернулся, и за это я вам благодарна. Я помогу Черному Копью. Я всегда вам помогала.', 54630),
(251635, 'ruRU', '', 'Кево?', 54630),
(251633, 'ruRU', 'Луку! Это друзья.  Им нужна помощь.', '', 54630),
(251632, 'ruRU', 'Черное Копье забыло о вас. Нам очень жаль.', '', 54630),
(251627, 'ruRU', '', 'Ты вернулся и все исправил. Пришло время прощать... и исцеляться.', 54630),
(251617, 'ruRU', 'Я думал, мы больше никому не нужны, и потому ушел. Прости меня.', '', 54630),
(251582, 'ruRU', '', 'Этой силы не хватит. Добавь третьего идола.', 54630),
(251577, 'ruRU', 'О, как приятно смотреть, как планы Мве\'залы рассыпаются в прах.', '', 54630),
(251576, 'ruRU', 'О-о-о! Маленький идол Джани! Он такой славный.', '', 54630),
(251572, 'ruRU', 'Встань перед алтарем, чтобы начать ритуал. Именно туда стекается сила лоа.', '', 54630),
(251571, 'ruRU', 'Можно попробовать. Но если она не в духе именно из-за Тишамаата, шансов мало.', '', 54630),
(251549, 'ruRU', 'Я ее отвлеку. Подними меня, Кево йа Сити.', '', 54630),
(251547, 'ruRU', '', 'Хватай перо, и мы взлетим!', 54630),
(251533, 'ruRU', 'Атар ва хиш\'ана, маат ирим ита. Под сенью вечных звезд мы все едины.', '', 54630),
(251531, 'ruRU', 'В благодарность за все свершенное тобой ради нашего народа мы даруем тебе священное облачение, изготовленное из драгоценных материалов с Аргуса.', '', 54630),
(251530, 'ruRU', 'Благодаря тебе Легион повержен. Наши скитания закончены. А наш народ снова стал единым народом.', '', 54630),
(251529, 'ruRU', 'Знай, без тебя бы мы не собрались сегодня здесь все вместе.', '', 54630),
(251501, 'ruRU', 'Соберись с духом и брось камни в Огонь Отдохновения. Почувствуй, как тяжкое бремя покидает твою душу.', '', 54630),
(251477, 'ruRU', 'Благодарить еще рано. Впереди вас ждут испытания. И Луку.', '', 54630),
(251476, 'ruRU', 'Спасибо, что дал нам шанс, Кево йа Сити. Черному Копью нужны старые лоа.', '', 54630),
(251474, 'ruRU', 'Мы сделаем новые. Но нам нужна помощь в борьбе с Мве\'залой.', '', 54630),
(251473, 'ruRU', 'Где твоя маска? Твоя руш\'ка.', '', 54630),
(251437, 'ruRU', 'Нам нужны сильные лоа. Но, боюсь, для этого придется как следует закопаться в прошлое. \n\nТы со мной, $n?', '', 54630),
(251436, 'ruRU', 'Бвонсамди принес очень дурные вести. Если замешан Мве\'зала, быть кровопролитию.', '', 54630),
(251434, 'ruRU', 'Оглянись. И ты увидишь их вокруг.', '', 54630),
(251432, 'ruRU', 'Скажи, что генератор не действует в целях… профилактики. Хотя ничего не говори. Я не хочу знать.', '', 54630),
(251421, 'ruRU', 'Мне нужно... подумать. Пойдем.', '', 54630),
(251419, 'ruRU', 'Хатуун, возможно, для тебя это не так важно... но нам необходимо поговорить. Тишамаат дает возможность осознать нам былые ошибки...', '', 54630),
(251418, 'ruRU', 'Как скажешь.', '', 54630),
(251416, 'ruRU', 'Первое таинство Тишамаата требует от нас осмыслить тени прошлого. Я прослежу, чтобы тебя приняли достойно.', '', 54630),
(251415, 'ruRU', 'Тишамаат? Я... благодарен... но разве мое присутствие не омрачит священное торжество?', '', 54630),
(251414, 'ruRU', 'Признаюсь, я... вызвал вас на Азерот не только для спасения острова... но и чтобы пригласить на Тишамаат.', '', 54630),
(251411, 'ruRU', 'Скверны больше нет. Остров Кровавой Дымки сможет исцелиться. Как и весь наш народ! Наконец-то...', '', 54630),
(251410, 'ruRU', 'Я не ожидал столкнуться здесь с такой серьезной угрозой. Но совместными усилиями мы сумели ее преодолеть.', '', 54630),
(251409, 'ruRU', '', 'В этот раз ты мне не помешаешь. Эти земли подчинились моей магии. И совсем скоро она подчинит всех в этом вашем жалком городе!', 54630),
(251407, 'ruRU', 'С радостью.', '', 54630),
(251406, 'ruRU', 'Мы с Хатууном перегрузим генератор. Сатиры почувствуют его энергию. Герой, Арзаал! Будете отбиваться.', '', 54630),
(251405, 'ruRU', 'Что? Э... Да, пророк! Сейчас сделаю! Калибрую перемещатель. Генератор отправлен!', '', 54630),
(251404, 'ruRU', 'Ромуул! Отправь нам один из наших генераторов. Прямо сейчас.', '', 54630),
(251403, 'ruRU', 'А? Что, кто? Я сейчас немного занят. У тебя что-то случилось?', '', 54630),
(251398, 'ruRU', 'Надо спешить. Герой, свяжись с Ромуулом. Он поможет.', '', 54630),
(251397, 'ruRU', 'Распространители Скверны! Кругом... по всему острову... Их здесь сотни!', '', 54630),
(251396, 'ruRU', '[Язык демонов] Маладат энкил, маэв рака тирос!', '', 54630),
(251395, 'ruRU', 'Делай, что требуется, Арзаал. Мы будем рядом.', '', 54630),
(251394, 'ruRU', 'Тут слишком тихо. Будьте готовы к засаде.', '', 54630),
(251393, 'ruRU', 'Хатуун прав. Здесь что-то скрыто. Надо понять, что именно.', '', 54630),
(251385, 'ruRU', 'Этот лагерь вроде бы заброшен. Но энергия Скверны здесь сильнее, чем в любой части острова.', '', 54630),
(251374, 'ruRU', 'Ясно. Тогда пойдем в северный лагерь и вернем его Арзаалу.', '', 54630),
(251373, 'ruRU', 'Вот и все. Осколок саргерита больше не реагирует на здешнюю энергию.', '', 54630),
(251371, 'ruRU', 'Я отозвал рангари с острова Кровавой Дымки, чтобы спасти. Их жизни были для меня важнее. И сейчас я поступил бы так же.', '', 54630),
(251370, 'ruRU', 'Распространители Скверны не давали острову исцелиться. А ты ничего не сделал! Почему?', '', 54630),
(251346, 'ruRU', 'Я... не знаю. Но от них надо избавиться!', '', 54630),
(251345, 'ruRU', 'Скрывающие чары? Подлая уловка Легиона. Как ты раньше этого не заметил, Велен?', '', 54630),
(251344, 'ruRU', 'Итак, начнем поиски.', '', 54630),
(251343, 'ruRU', 'Хорошо. Хатуун! Возьми этот осколок саргерита. Он укажет на энергию Скверны, созданную ман\'ари.', '', 54630),
(251341, 'ruRU', 'Арзаал, обыщи северный лагерь сатиров. Герой, Хатуун, пойдете со мной в лагерь на западе.', '', 54630),
(251340, 'ruRU', 'Значит, за набегами стоит кто-то более сильный?', '', 54630),
(251339, 'ruRU', 'Скверна глубоко поразила эти создания... Простые демоны на такое не способны.', '', 54630),
(251331, 'ruRU', 'Скоро это закончится. Если придется, я убью каждого демона... собственными руками.', '', 54630),
(251330, 'ruRU', 'На борьбу с ними не было времени и ресурсов. Все силы были брошены на устранение других угроз.', '', 54630),
(251325, 'ruRU', 'Почему вы позволили демонам так долго осквернять эти земли?', '', 54630),
(251318, 'ruRU', 'Это так. Энергия Пустоты, просочившаяся из корабля, затруднила очистку острова.', '', 54630);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(251317, 'ruRU', 'Порча, вызванная крушением \"Экзодара\", весьма... необычна.', '', 54630),
(251316, 'ruRU', 'Мы умеем избавляться от демонов. Да и ты тоже. С твоей помощью мы управимся быстро... и без лишнего шума.', '', 54630),
(251315, 'ruRU', 'Но Велен понял, что его полумеры не сработают без поддержки. Вот поэтому позвал меня и других новых союзников.', '', 54630),
(251314, 'ruRU', 'Он решил прогнать сатиров на остров и тем самым обезопасить путников. На время.', '', 54630),
(251313, 'ruRU', 'Я хотел отправить туда воздаятелей, но Велен заявил, что это вызовет панику и якобы омрачит Тишамаат. Пф!', '', 54630),
(251312, 'ruRU', 'Велен сообщил, что сегодня утром на дренеев как минимум четыре раза напали сатиры.', '', 54630),
(251305, 'ruRU', 'Забирайся на манаската. Поедем к Велену на остров Кровавой Дымки.', '', 54630),
(251296, 'ruRU', 'Это все? Знаешь, а я вот ни капли не удивлен. Догадался, как только ты меня позвал.', '', 54630),
(251295, 'ruRU', '', 'Хм!.. Давай загрузим чертежи, пока я не передумала.', 54630),
(251294, 'ruRU', 'Я рад, что ты с нами, высший механолог. Это значительно упрощает задачу.', '', 54630),
(251293, 'ruRU', '', 'Я... сама доставлю данные в Экзодар. И на Тишамаат.', 54630),
(251292, 'ruRU', '', 'Но этого не будет. Я спроектировала город, которым Шаттрат должен был стать. Каким он мог бы стать.', 54630),
(251291, 'ruRU', '', 'Он жил ради Шаттрата... и умер за него. Порой я думала, что разделю его участь.', 54630),
(251290, 'ruRU', '', 'Мой отец был лучшим механологом на Дреноре.', 54630),
(251287, 'ruRU', '', 'Ох... Свет милостивый... Что тебе опять надо?', 54630),
(251285, 'ruRU', 'Полагаю, он жалеет только лишь об одном: о том, что не может быть с дочерью.', '', 54630),
(251284, 'ruRU', 'Экзарх Хатаару принял и свою жизнь, и смерть, и успехи, и неудачи. Обратись к нему со своей просьбой.', '', 54630),
(251264, 'ruRU', 'Спасибо тебе за помощь. Могила экзарха Хатаару находится на той стороне. Идем за мной!', '', 54630),
(251263, 'ruRU', 'Возможно, нужен не один Тишамаат, чтобы подарить покой Ресталаану. Но я помогу ему, чего бы мне это ни стоило.', '', 54630),
(251262, 'ruRU', 'Поразительно, но его душа выдержала все испытания. Он готов. Пожалуйста, запечатай урну.', '', 54630),
(251261, 'ruRU', 'Он ненароком одарил орков оружием, погубившим его... и Телмор. Надо развеять его чувство вины.', '', 54630),
(251260, 'ruRU', 'А... Ресталаан, наставник Ларохира! Его история полна крови и предательства. Теперь установим связь с ним.', '', 54630),
(251258, 'ruRU', 'Пусть Келиос избавится от страха перед Тьмой. Да облегчит Свет его боль.', '', 54630),
(251257, 'ruRU', 'Келиос готов к Тишамаату. Запечатай урну.', '', 54630),
(251256, 'ruRU', 'Он сражался с силами Тьмы. Она преследует его и в смерти. Помоги ему – пусть он вновь увидит Свет.', '', 54630),
(251255, 'ruRU', 'А теперь пробудим экзарха Келиоса, первого воздаятеля и защитника Карабора.', '', 54630),
(251252, 'ruRU', 'Надеюсь, Тишамаат поможет Ларохиру избавиться от чувства вины за потерю Шаттрата.', '', 54630),
(251251, 'ruRU', 'Он говорит, что готов. Запечатай урну символом Д\'оре.', '', 54630),
(251250, 'ruRU', 'Он защищал Шаттрат до последнего вздоха. Духи до сих пор видят в нем опору. Теперь же мы должны их упокоить.', '', 54630),
(251249, 'ruRU', 'Это гробница экзарха Ларохира, генерала пророка. Сначала свяжемся с ним.', '', 54630),
(251248, 'ruRU', 'Встретимся на верхнем ярусе. Надо связаться там с духами и подготовить их к дороге.', '', 54630),
(251247, 'ruRU', 'Без помощи не обошлось... Кхм...', '', 54630),
(251246, 'ruRU', 'Благодарю, Немураан. Значит, меня теперь хорошо видно, м?', '', 54630),
(251244, 'ruRU', 'Черное Копье – значит верность. И мы, лоа, это хорошо знаем.', '', 54630),
(251243, 'ruRU', 'Мы знаем, в чем ваша сила.', '', 54630),
(251242, 'ruRU', '', 'Мы бы не стали помогать, если бы вы начали жертвовать своими.', 54630),
(251241, 'ruRU', 'А тролли Черного Копья обратились к старым лоа. Они нашли друзей.', '', 54630),
(251240, 'ruRU', 'Когда Амани, Драккари и Зандалари запаниковали, они обратили оружие против своих.', '', 54630),
(251239, 'ruRU', 'С Черным Копьем такое не пройдет. Именно поэтому я и не вмешивался.', '', 54630),
(251238, 'ruRU', 'А что надо было делать? Перебить их? Хм!', '', 54630),
(251237, 'ruRU', 'Но горстки испуганных троллей, примкнувших к Мве\'зале, чуть не хватило, чтобы все испортить.', '', 54630),
(251236, 'ruRU', 'Я всегда присматриваю за вашим племенем. То, что я лоа королей, ничего не меняет.', '', 54630),
(251226, 'ruRU', 'Атаания? Значит, время пришло...\n\nТебе нужно поговорить с нашим экзархом.', '', 54630),
(251211, 'ruRU', 'Хочешь попасть в Бамбалу побыстрее – это через мою сокровищницу!', '', 54630),
(251190, 'ruRU', 'Да, высший механолог! Идем, герой. Я дам тебе кристалл.', '', 54630),
(251189, 'ruRU', '', 'Беруун! Где кристалл? Слушай, отнеси его Ромуулу. Скажи, я пропущу Тишамаат по уважительной причине.', 54630),
(251186, 'ruRU', '', 'Ты... Вообще-то я не просила мне помогать.', 54630),
(251177, 'ruRU', 'О, пропавший груз! Скажи высшему механологу, что все будет готово после праздника. Сейчас у нас выходной!', '', 54630),
(251176, 'ruRU', '<Хрустальный шар на памятнике погас. Вы вобрали его силу... на какое-то время.>', '<Хрустальный шар на памятнике погас. Вы вобрали его силу... на какое-то время.>', 54630),
(251174, 'ruRU', '<Перед вами сияет хрустальный шар, где мелькают образы странных мурлоков.\n\nОсмелитесь ли вы прикоснуться к нему?>', '<Перед вами сияет хрустальный шар, где мелькают образы странных мурлоков.\n\nОсмелитесь ли вы прикоснуться к нему?>', 54630),
(251169, 'ruRU', '', 'Спасибо! С ящиками мы управимся. Можешь отнести эти фрагменты ваятелям кристаллов.', 54630),
(251165, 'ruRU', 'С дренитом из Пустоверти вечно проблемы. Надо было лучше все закрепить!', '', 54630),
(251164, 'ruRU', '', 'Эй, ты! Не поможешь? Повозку так растрясло, что ящики свалились!', 54630),
(251156, 'ruRU', 'Джани тоже так считает.', '', 54630),
(251155, 'ruRU', 'Бвонсамди... Тцада решила, что ты стал о нас забывать.', '', 54630),
(251139, 'ruRU', 'На нашу с тобой долю, $n, выпало славное приключение!', '', 54630),
(251108, 'ruRU', '', 'Возьми кристалл у Берууна. И давай – марш из моей мастерской.', 54630),
(251101, 'ruRU', '', 'У меня здесь работа. Я не покину Шаттрат ради какого-то древнего праздника.', 54630),
(251100, 'ruRU', '', 'Я уже сообщила Ромуулу, что все чертежи готовы. А если он ждет меня в Экзодаре, то передай ему, что не дождется.', 54630),
(251095, 'ruRU', '', 'Если ты хочешь сейчас меня отвлечь, то имей в виду: у меня сварочный аппарат и ноль терпения.', 54630),
(251094, 'ruRU', 'Атаания, конечно, иногда очень сильно упрямится, но ты все равно настаивай на своем.', '', 54630),
(251093, 'ruRU', 'Фух, хорошо! Все заработало. Так, теперь не хватает лишь самой презентации... и ее ведущей.', '', 54630),
(251092, 'ruRU', 'Наш проект пришелся как нельзя кстати. Поэтому Велен попросил представить его гостям прямо во время торжества.', '', 54630),
(251091, 'ruRU', 'И этот праздник не проводился много лет.', '', 54630),
(251090, 'ruRU', 'Ты помнишь, как мы каждый год праздновали Тишамаат на Аргусе?', '', 54630),
(251089, 'ruRU', 'Тебе никто ничего не сообщил? Пророк объявил, что мы будем отмечать Тишамаат. Сегодня!', '', 54630),
(251081, 'ruRU', 'А вот и ты! Я уже начал волноваться, думал, в голографите заряд кончился.', '', 54630),
(251068, 'ruRU', 'А ниже опиши воспоминание, которое тебя тревожит и тяготит. О котором хотелось бы забыть.\n\nЗабыть, конечно, не выйдет. Мы должны помнить уроки прошлого. Но мы не должны страдать из-за них целую вечность. Если боль, сожаление или вина придавят тебя к земле, ты не сможешь двигаться дальше.', '', 54630),
(251055, 'ruRU', 'Приступим к созданию камня воспоминаний?\n\nТишамаат не праздновали уже давно, традиции почти забылись. Но я расскажу, что нужно делать.\n\nДля начала напиши наверху свое имя.', '', 54630),
(251040, 'ruRU', 'Надо взглянуть поближе...', '', 54630),
(251039, 'ruRU', 'Может, это не то испытание, на которое мы рассчитывали, но мы все еще можем установить связь с нашими истинными лоа.', '', 54630),
(251002, 'ruRU', 'Остановим Тцаду, пока она не насытилась силой обряда!', '', 54630),
(250993, 'ruRU', 'Мве\'зала был лоа смерти задолго до твоего старого приятеля Бвонсамди. Да, есть тролли, которые ему поклоняются. Но знай: он помогал Тюремщику и переманил к нему Хелию. Он уговорил Одина отдать глаз и обманул Вол\'джина, чтобы тот сделал Сильвану вождем вашей Орды. Он заточил других лоа в Темных Землях.\n\nМве\'зала – страшный злодей, но я с ним справился. Запер на Той Стороне. Где он и будет сидеть, если никто его оттуда не достанет. И лучше бы не достали – это скверный старик.', '', 54630),
(250970, 'ruRU', 'Мве\'зала – самый злой злодей и забияка.', '', 54630),
(250968, 'ruRU', 'И Джани на сей раз не забудьте!', '', 54630),
(250966, 'ruRU', 'Кево йа Сити! Надели мои клинки силой, как делал это для темных охотников.', '', 54630),
(250965, 'ruRU', 'Вот увидите. Славная вещь.', '', 54630),
(250963, 'ruRU', 'У Джани есть то, что нужно! Сейчас найду.', '', 54630),
(250773, 'ruRU', 'Что, охотишься на мою добычу?', '', 54630),
(250772, 'ruRU', 'Я все вижу.', '', 54630),
(250732, 'ruRU', '', 'Шикарно! Больше находок – больше знаний о тех, кто здесь раньше жил!', 54630),
(250731, 'ruRU', '', 'Ого, вот это находочка! Возможно, даже лучше прежней... Ну так давай проверим!', 54630),
(250682, 'ruRU', '', 'Неизвестно, какие тайны там под землей. Займемся раскопками и все узнаем!', 54630),
(250599, 'ruRU', '', 'Мве\'зала! Воплотись во мне, стань покровителем Черного Копья.', 54630),
(250595, 'ruRU', 'Мве\'зала! Тебя сюда не приглашали.', '', 54630),
(250590, 'ruRU', 'Три идола? Тцада! Что ты творишь?', '', 54630),
(250588, 'ruRU', 'Добро пожаловать на \"Геотермальные горки\"!\n \nЭто очень короткая трасса. Тебе всего и надо будет, что пролететь над полями из едкой соли, увернуться от всех ядовитых гейзеров и не врезаться ни в один геотермальный агрегат.\n\nДиспетчеры со взлетной полосы Выкрутеня заверили меня, что все эти препятствия ни капли не мешают воздушным кораблям. А значит, и тебе не помешают.', 'Добро пожаловать на \"Геотермальные горки\"!\n \nЭто очень короткая трасса. Тебе всего и надо будет, что пролететь над полями из едкой соли, увернуться от всех ядовитых гейзеров и не врезаться ни в один геотермальный агрегат.\n\nДиспетчеры со взлетной полосы Выкрутеня заверили меня, что все эти препятствия ни капли не мешают воздушным кораблям. А значит, и тебе не помешают.', 54630),
(250580, 'ruRU', 'Отнеси туда, где вождь раскрашивает свою маску.', '', 54630),
(250578, 'ruRU', 'Теперь лоа благословят нас... и назначат испытания.', '', 54630),
(250512, 'ruRU', 'Руш\'ки – это священные маски троллей. Они соединяют нас с лоа.\n\nМы не просто раскрашенные деревяшки мастерим, о нет.\n\nЯ чувствую связь с Кево йа Сити. Он в тенях и его никто не замечает – и меня тоже никто не замечал в тени Вол\'джина. Мне надо выйти из тени, пойти собственным путем. Не ради себя, но ради Черного Копья.\n\nВозможно, моя руш\'ка воплотит именно это.', '', 54630),
(250350, 'ruRU', '', 'Бвемба хохочет и подмигивает мастеру Гадрину.', 54630),
(250349, 'ruRU', 'Вот уж не думал, что стану художником...', '', 54630),
(250348, 'ruRU', 'Здесь есть все, что нужно для священных масок: дерево, краски и моджо.', '', 54630),
(250345, 'ruRU', 'Руш\'ки священны. Если сделаем все как надо, это будет честь для нашего племени.', '', 54630),
(250344, 'ruRU', '', 'Хорошо. Теперь потребуется маска.', 54630),
(250343, 'ruRU', '', 'Настоящие лоа Черного Копья скоро вернутся к нам...', 54630),
(250276, 'ruRU', 'Привет! Здесь начинается маршрут \"Суматоха в Шолазаре\".\n \nМожешь оставить здесь все свои доспехи с защитой от холода – они тебе не понадобятся. В низине Шолазар тепло и сыро, как в кратере Ун\'Горо. Ты спросишь, как это возможно? Все очень просто. Магия титанов.\n \nК сожалению, я не знаю, как именно они этого добились, потому что не разбираюсь в погодных заклятьях. Мое дело – замерять время. Время, которое ты потратишь на гонку. Ну, приступим!', 'Привет! Здесь начинается маршрут \"Суматоха в Шолазаре\".\n \nМожешь оставить здесь все свои доспехи с защитой от холода – они тебе не понадобятся. В низине Шолазар тепло и сыро, как в кратере Ун\'Горо. Ты спросишь, как это возможно? Все очень просто. Магия титанов.\n \nК сожалению, я не знаю, как именно они этого добились, потому что не разбираюсь в погодных заклятьях. Мое дело – замерять время. Время, которое ты потратишь на гонку. Ну, приступим!', 54630),
(250275, 'ruRU', '', 'Поставь идолов на алтарь.', 54630),
(250273, 'ruRU', '', 'Признаться, я не ждала, что вы вернете всех этих старых лоа. О Кево йа Сити и Луку я и не слышала никогда.\n\nНачнем готовить алтарь к Испытанию лоа?', 54630),
(250271, 'ruRU', 'Скорей... скажи ей... кто...', '', 54630),
(250270, 'ruRU', '', 'Вы заплатите за то, что сделали! ', 54630),
(250269, 'ruRU', '', 'Где я?..', 54630),
(250268, 'ruRU', '', 'О! Я... люблю Черное Копье.', 54630),
(250266, 'ruRU', '', 'Я страдаю из-за огров. Я покажу вам всю свою боль!', 54630),
(250246, 'ruRU', 'Уши просто огнем горят! Кто-то меня вспоминает.', '', 54630),
(250245, 'ruRU', 'Хочешь убить Май\'Зота?', '', 54630),
(250244, 'ruRU', 'Алтарь Луку... он разрушен.', '', 54630),
(250243, 'ruRU', 'Добрались! Спасибо, Кево йа Сити.', '', 54630),
(250208, 'ruRU', 'Этот маршрут называется \"Облет Цитадели\".\n \nГоворят, чем страшнее крепость, тем веселее через нее летать! А значит, тебе будет ну очень весело! Цитадель Ледяной Короны – одна из самых жутких крепостей в Азероте! Только взгляни на эти великолепные шипы, на башни, на высоченные стены.\n \nВажное замечание: я не одобряю поведение Короля-лича и не считаю, что превращать всех в нежить – хорошо и правильно. Но его крепость – это произведение искусства! Прихожу в восторг всякий раз, как только ее вижу.', 'Этот маршрут называется \"Облет Цитадели\".\n \nГоворят, чем страшнее крепость, тем веселее через нее летать! А значит, тебе будет ну очень весело! Цитадель Ледяной Короны – одна из самых жутких крепостей в Азероте! Только взгляни на эти великолепные шипы, на башни, на высоченные стены.\n \nВажное замечание: я не одобряю поведение Короля-лича и не считаю, что превращать всех в нежить – хорошо и правильно. Но его крепость – это произведение искусства! Прихожу в восторг всякий раз, как только ее вижу.', 54630),
(250199, 'ruRU', 'Это великая минута для всех дренеев.\n\nДля всех нас.', '', 54630),
(250185, 'ruRU', 'Триумвирату поручили сопровождать Арзаала и других кающихся, пока идет Тишамаат.\n\nЯ верю пророку, но все же разделяю опасения остальных. Когда нам тайно сообщили о Тишамаате, многие встревожились.\n\nВозможно, опасения никогда меня не покинут. Время покажет.\n\nНу а пока я постараюсь поверить, что прошлое кающихся и вправду осталось в прошлом. В конце концов, они смогут это доказать.', '', 54630),
(250184, 'ruRU', '', 'Вижу, тебе удалось выманить высшего механолога из уютной мастерской на Возвышенности Алдоров.\n\nПророку не стоило волноваться. Если б у тебя не получилось, я бы лично приволокла ее сюда.\n\n<Ишана весело улыбается. Весело – и коварно.>\n\nОна уже целую вечность трудится над своими чертежами. Я никогда не спрашивала, что это за чертежи, но, думаю, мы скоро сами все увидим.', 54630),
(250183, 'ruRU', 'Мне радостно от того, что аукенаи снова заботятся о душах тех, кто нас покинул.\n\nЛарохир когда-то был моим командиром. Я до сих пор считаю его своим другом, даже в посмертии.\n\nЯ счастлив, что мы снова с ним встретились, и навсегда запомню эти краткие минуты.', '', 54630),
(250178, 'ruRU', '', 'До последней минуты я думала, что откажусь.\n\nЯ жила в Тероккаре с тех самых пор, как... как случилось то, что случилось. Поначалу было непросто, но со временем я привыкла. Жизнь стала спокойной. Тихой.\n\nВ одиночестве хорошо.\n\nПосле того, что я и мои рангари допустили, я попросту не могла вернуться назад. Не могла жить среди тех, кто пострадал из-за меня.\n\nДумаю, Тишамаат – лучшее время, чтобы вспомнить эту вину и сделать выводы.', 54630),
(250175, 'ruRU', 'Я почти забыл Келиоса. Почти забыл о далеком прошлом, а что помню, то окутано тьмой.\n\nНо он заговорил о Караборе так, будто только вчера ходил по его залам, любовался его красотой.\n\nИ я словно перенесся туда на секунду.', '', 54630),
(250174, 'ruRU', 'Я рад, что воздаятели здесь. Это успокаивает остальных.\n\nБорос предложил мне показать остров Лазурной Дымки, когда Тишамаат закончится.\n\n<Он еле заметно улыбается.>\n\nПодозреваю, ему так приказал пророк. Но я не откажусь от подарка. Пусть ничем его и не заслужил.', '', 54630),
(250173, 'ruRU', 'Давно я не видывал, чтобы столько эредаров собиралось в одном месте. Думаю, это было еще до того как Аргус осквернили. Я тогда служил в Совете Триумвирата.\n\nВелен лично сделал меня своим главным советником. Тогда мы хорошо знали друг друга, и испытывали взаимное доверие.\n\nТо была совсем иная жизнь. Сейчас она так же далека, как Аргус от Экзодара.\n\n<Хатуун замолкает: он погрузился в раздумья о прошлом.>', '', 54630),
(250172, 'ruRU', 'Эредары слишком долго не знали единства.\n\nНо сегодня нас снова сплотили вера и надежда.\n\nЯ вижу будущее: оно залито солнечным светом. И мы войдем в него рука об руку.', '', 54630),
(250171, 'ruRU', '', '<Атаания лениво настраивает механологическую линзу, но тут же бросает, когда замечает вас.>\n\nЧто нужно?', 54630),
(250169, 'ruRU', 'Какой долгий и трудный день выдался. Без твоей помощи он был бы еще дольше и труднее.', '', 54630),
(250164, 'ruRU', 'Джани как-нибудь сам доберется. Прокатиться с Кево? Нет уж, ни за что.', '', 54630),
(250163, 'ruRU', 'Подождите Джани!', '', 54630),
(250162, 'ruRU', 'Луку где-то рядом.', '', 54630),
(250161, 'ruRU', 'Начнем, $n? Приготовься: может закружиться голова.', '', 54630),
(250159, 'ruRU', 'Они могли навредить Луку!', '', 54630),
(250158, 'ruRU', 'Курган Мош\'Огг поблизости – на юго-востоке.', '', 54630),
(250157, 'ruRU', 'Я был уверен в том, что про нас все давно забыли.', '', 54630),
(250156, 'ruRU', 'Ее боль. Если подойдем ближе, я ее почувствую.', '', 54630),
(250155, 'ruRU', 'Мы повздорили. Я ушел. Возможно, она направилась к алтарю...', '', 54630),
(250153, 'ruRU', 'Где же Луку прячется?', '', 54630),
(250151, 'ruRU', 'Луку – лоа регенерации, отважная и яростная. Она не прячется. Что-то произошло.', '', 54630),
(250136, 'ruRU', 'Привет! Ты в начале трассы \"Пролет над Погостом\".\n \nМы часто устраиваем гонки в каком-нибудь священном месте. Думаю, теперь пора провести их в области, особенно почитаемой нами, драконами. Здесь, на Драконьем Погосте, зародился наш крылатый народ и сюда же мы возвращаемся в конце жизни. Когда я смотрю на эту гигантскую заснеженную пустошь, меня так и захлестывают самые разные чувства.\n \nНу что ж! Как известно, лучший способ выплеснуть эмоции – это гонка!', 'Привет! Ты в начале трассы \"Пролет над Погостом\".\n \nМы часто устраиваем гонки в каком-нибудь священном месте. Думаю, теперь пора провести их в области, особенно почитаемой нами, драконами. Здесь, на Драконьем Погосте, зародился наш крылатый народ и сюда же мы возвращаемся в конце жизни. Когда я смотрю на эту гигантскую заснеженную пустошь, меня так и захлестывают самые разные чувства.\n \nНу что ж! Как известно, лучший способ выплеснуть эмоции – это гонка!', 54630),
(250135, 'ruRU', '', 'Я мало что знаю о Луку, мне больше знаком ее брат, Кево йа Сити. Он может выследить любую добычу. Если он с тобой, ты найдешь то, что ищешь.\n\nБвонсамди – душа Черного Копья, но Луку и Кево йа Сити – наше сердце и голова. Давно это было. Я помню истории о ритуалах в честь Луку. Их проводили в пещерах неподалеку от места, где сейчас стоит Бамбала.\n\nНо сейчас те пещеры захватили огры.', 54630),
(250134, 'ruRU', '', 'Что привело тебя в Бамбалу?', 54630),
(250133, 'ruRU', '', 'Да. Луку – лоа регенерации... и боли.\n\nНе той боли, когда тебя ранят, но той, когда раны затягиваются.\n\nЭто боль от лихорадки или синяка. Если тебе плохо, значит, ты поправляешься.\n\nМы давно не чувствовали боль. Мы почти забыли историю Черного Копья. Забыли Луку. Я пришла сюда медитировать и размышлять над своим горем. Я чувствовала Луку, пусть и слабо. Быть может, она где-то рядом и до сих пор наставляет нас.', 54630),
(250132, 'ruRU', '', 'Как дела?', 54630),
(250131, 'ruRU', 'Я долго следовал учению Луку. Она вообще-то покровительница знахарей и жрецов, но помогала и темным охотникам. Говорят, она – само время, она может залечить любую рану. Она и троллям даровала такую силу.\n\nПотерять Луку – все равно что потерять самую суть Черного Копья. Мы больше не можем исцелять себя так, как прежде. Я до сих пор ее почитаю, но почти не чувствую ее силу. Она как будто слишком далеко.\n\nЕсли верить сказаниям, где-то тут, в Тернистой долине, стоит древнее святилище Луку. Но где его искать, никто не знает.', '', 54630),
(250127, 'ruRU', 'Что делаешь в Бамбале?', '', 54630),
(250125, 'ruRU', 'Это... Кево йа Сити?\n\nИ Джани?!', '', 54630),
(250095, 'ruRU', '<Кево йа Сити молча смотрит на вас и ждет.>', '', 54630),
(250084, 'ruRU', 'Черное Копье совсем тебя забыло. Я хочу все исправить.', '', 54630),
(250083, 'ruRU', 'Обернись, Джани.', '', 54630),
(250081, 'ruRU', 'Думаю, сатиры сразу набросятся на нас, как только мы начнем заряжать генератор.\n\nПодготовься и скажи, когда начинать.', '', 54630),
(250079, 'ruRU', 'Приветствую! Этот маршрут называется \"Гонки в лесу Хрустальной Песни\".\n \nВысокорожденные Шандарала так жаждали овладеть всей магией на свете, что украли у синих драконов приемы и науки. Навыка, чтобы управиться с такой силой, им, конечно, не хватало. Синие драконы в долгу не остались, и конфликт закончился печально. Результат ты видишь прямо внизу – я про кристальный лес.\n \nЗдесь так спокойно и красиво. Даже не верится, что этот лес возник из-за великой трагедии. Но история любит неожиданные повороты. Тут мы с ней похожи.', 'Приветствую! Этот маршрут называется \"Гонки в лесу Хрустальной Песни\".\n \nВысокорожденные Шандарала так хотели овладеть всей магией на свете, что украли у синих драконов их достижения. Навыка, чтобы управиться с такой силой, им, конечно, не хватало. Синие драконы в долгу не остались, и конфликт закончился печально. Результат ты видишь прямо внизу – я про кристальный лес.\n \nЗдесь так спокойно и красиво. Даже не верится, что этот лес возник из-за великой трагедии. Но история любит неожиданные повороты. Тут мы с ней похожи.', 54630),
(250045, 'ruRU', '<жуткий смех>', '', 54630),
(250044, 'ruRU', 'Кево йа Сити! Ну зачем ты так! Старый лис.', '', 54630),
(250043, 'ruRU', 'А-а-а!', '', 54630),
(250042, 'ruRU', 'Большой лоа совсем рядом! Смотри в оба!', '', 54630),
(250041, 'ruRU', 'Скрытный лоа был здесь. Рядом наверняка есть еще жертвы.', '', 54630),
(250030, 'ruRU', 'Джани знает подходящие места. Я скоро буду.', '', 54630),
(250028, 'ruRU', 'Тут плохие ребята. Иди и погляди. Или не ходи.', '', 54630),
(249988, 'ruRU', 'Зул\'Гуруб... У этого места скверная история.', '', 54630),
(249983, 'ruRU', 'Приветствую. \n\nЕсли тебе нужны услуги ваятеля кристаллов, то, боюсь, у нас нет времени. Разумеется, я посмотрю, что можно сделать.\n\nМеханологи загрузили нас работой.', '', 54630),
(249975, 'ruRU', 'Этот маршрут называется \"Марафон Творцов\".\n \nДа уж, титаны умели строить с размахом. Ульдуар – гигантский комплекс, который они возвели первым делом, как явились в Азерот. Кстати, ты знаешь, что они сражались с древними богами долгие тысячи лет? Так долго, что эти битвы повлияли на все живое. Вот где настоящий марафон!\n \nНу а эта трасса просто займет у тебя чуть больше времени, чем обычно. Но что такое эти жалкие минуты? Лишь краткий миг в сравнении с вечностью. И все же поторопись, если хочешь когда-нибудь долететь до конца.', 'Этот маршрут называется \"Марафон Творцов\".\n \nДа уж, титаны умели строить с размахом. Ульдуар – гигантский комплекс, который они возвели первым делом, как явились в Азерот. Кстати, ты знаешь, что они сражались с древними богами долгие тысячи лет? Так долго, что эти битвы повлияли на все живое. Вот где настоящий марафон!\n \nНу а эта трасса просто займет у тебя чуть больше времени, чем обычно. Но что такое эти жалкие минуты? Лишь краткий миг в сравнении с вечностью. И все же поторопись, если хочешь когда-нибудь долететь до конца.', 54630),
(249973, 'ruRU', 'И не такое проделывали. Пошли. За мной!', '', 54630),
(249971, 'ruRU', 'Будете искать лоа в отбросах? Удачи!', '', 54630),
(249970, 'ruRU', 'Возможно, я и помогу! Поройся в сокровищнице Джани и докопай до Зул\'Гуруба.', '', 54630),
(249969, 'ruRU', 'Джани и правда много знает... Ты правильно заметил, вождь троллей.', '', 54630),
(249968, 'ruRU', 'Джани! Нам очень нужна твоя мудрость.', '', 54630),
(249966, 'ruRU', 'А-а-а! Нельзя же так внезапно! У Джани были важные дела.', '', 54630),
(249965, 'ruRU', 'Джани! Лоа собирателей и секретов! Я призываю тебя!', '', 54630),
(249964, 'ruRU', 'Я могу все ускорить. Мне не сложно.', '', 54630),
(249958, 'ruRU', '<Беруун наклоняется к вам и говорит тише.>\n\nРомуул много раз писал Атаании про Тишамаат. Они обычно ладят друг с другом, но... она не ответила ни на одно послание. И с тех пор ходит в очень дурном настроении. То есть в еще более дурном, чем обычно.\n\nОна говорит, что до Экзодара слишком долго добираться, а у нее много работы. Но... подозреваю, дело не во времени, а в самом Тишамаате. Но если ее немного разгрузить, ей ведь... должно стать лучше, правда?\n\nОна как раз ждет поставку дренита, но та задерживается. Может, ты найдешь этот дренит?\n\nТогда у нее наверняка появится и время, и настроение, чтобы посетить Экзодар.', '', 54630),
(249956, 'ruRU', '', 'Чего надо? Мне не до тебя.', 54630),
(249954, 'ruRU', 'Они устали нас ждать. Найдем их сами.', '', 54630),
(249945, 'ruRU', '', 'Они нас не слышат. Или просто не хотят возвращаться.', 54630),
(249938, 'ruRU', 'Хотя обстоятельства самую малость тревожнее, чем мне бы хотелось, я рад, что наконец-то могу поработать над чем-то кроме артиллерии!', '', 54630),
(249903, 'ruRU', 'Добро пожаловать к началу трассы \"Зефир над Зул\'Драком\".\n\nОна короткая и веселая. И абсолютно обычная. Ты просто летишь себе через лес, уворачиваешься от колючек, любуешься на руины древней цивилизации, ну и, может, разок-другой глянешь на здоровенную махину, собранную из мертвых штормовых великанов.\n\nВсе как всегда. Ты, наверное, такое каждый день видишь.', 'Добро пожаловать к началу трассы \"Зефир над Зул\'Драком\".\n\nОна короткая и веселая. И абсолютно обычная. Ты просто летишь себе через лес, уворачиваешься от колючек, любуешься на руины древней цивилизации, ну и, может, разок-другой глянешь на здоровенную махину, собранную из мертвых штормовых великанов.\n\nВсе как всегда. Ты, наверное, такое каждый день видишь.', 54630),
(249828, 'ruRU', 'Этот маршрут называется \"Виражи Черноречья\".\n \nСразу скажу: я не одобряю поведение Торговой компании. Она проходится по землям, как саранча, высасывает все, что может, и оставляет после себя мертвые пустоши. А я люблю леса – из них выходят отличные гоночные трассы. Ничто не заменит деревья! Ничто и никогда!\n\nХотя... если подумать, через обломки и развалины тоже можно проложить неплохой маршрут...', 'Этот маршрут называется \"Виражи Черноречья\".\n \nСразу скажу: я не одобряю поведение Торговой компании. Она проходится по землям, как саранча, высасывает все, что может, и оставляет после себя мертвые пустоши. А я люблю леса – из них выходят отличные гоночные трассы. Ничто не заменит деревья! Ничто и никогда!\n\nХотя... если подумать, через обломки и развалины тоже можно проложить неплохой маршрут...', 54630),
(249792, 'ruRU', 'Добро пожаловать! Этот маршрут называется \"Рывок в бухте Кинжалов\".\n \nМы стоим на самой вершине крепости Утгард, где когда-то правил Имирон, король всех врайкулов. Мы, бронзовые драконы, называем таких, как он, плохишами. Видишь эти черепа в стенах? Сразу видно – злодей. А еще он хотел истребить всех людей, когда они только появились.\n \nНо чем страшнее крепость, тем веселее через нее летать, не так ли? Впрочем, скалистые фьорды вокруг бухты Кинжалов тоже не дадут заскучать!', 'Добро пожаловать! Этот маршрут называется \"Рывок в бухте Кинжалов\".\n \nМы стоим на самой вершине крепости Утгард, где когда-то правил Имирон, король всех врайкулов. Мы, бронзовые драконы, называем таких, как он, плохишами. Видишь эти черепа в стенах? Сразу видно – злодей. А еще он хотел истребить всех людей, когда они только появились.\n \nНо чем страшнее крепость, тем веселее через нее летать, не так ли? Впрочем, скалистые фьорды вокруг бухты Кинжалов тоже не дадут заскучать!', 54630),
(249692, 'ruRU', 'Привет! Здесь начинается трасса \"Скалавагский слалом\".\n \nЛопни моя селезенка, салага! Чего ты на меня так смотришь? Эту присказку постоянно повторяют те пираты внизу. Нет, они не хотят, чтобы у них лопнула селезенка. Просто вода в Северном море такая холодная, что селезенка и впрямь того и гляди лопнет.\n \nДумаешь, я специально сделал пиратскую гонку? Нет, я выбрал это место из-за великолепных утесов и айсбергов. Пиратов добавил только потому, что публика их любит.', 'Привет! Здесь начинается трасса \"Скалавагский слалом\".\n \nЛопни моя селезенка, салага! Чего ты на меня так смотришь? Эту присказку постоянно повторяют те пираты внизу. Нет, они не хотят, чтобы у них лопнула селезенка. Просто вода в Северном море такая холодная, что селезенка и впрямь того и гляди лопнет.\n \nДумаешь, я специально сделала пиратскую гонку? Нет, я выбрала это место из-за великолепных утесов и айсбергов. Пиратов добавила только потому, что публика их любит.', 54630),
(249644, 'ruRU', '<Урна покрыта толстым слоем пыли. Похоже, к ней никто не прикасался уже много лет.>', '<Урна покрыта толстым слоем пыли. Похоже, к ней никто не прикасался уже много лет.>', 54630),
(249564, 'ruRU', 'Прошу прощения, но сейчас мы очень заняты ритуалом связи душ.\n\nНадо позаботиться о душах, за которые мы в ответе. Только потом мы сможем ответить на приглашение пророка на Тишамаат и отправиться в Экзодар.\n\nТебе нужна помощь? Что-то срочное?', '', 54630),
(249499, 'ruRU', 'Гм, я уже устал ждать!', '', 54630),
(249497, 'ruRU', 'Быстро же это имя вылетело у тебя из головы. Может, потому что у него их много: Друг Ночи, Отец Сна – это все он.\n\nМве\'зала был лоа смерти задолго до твоего старого приятеля Бвонсамди. Да, есть тролли, которые ему поклоняются. Но знай: он помогал Тюремщику и переманил к нему Хелию. Он уговорил Одина отдать глаз и обманул Вол\'джина, чтобы тот сделал Сильвану вождем вашей Орды. Он заточил других лоа в Темных Землях.\n\nОн страшный злодей, но вместе мы его одолели. Заперли на Той Стороне. Остановим троллей, которые ему помогают, и можешь снова про него забыть.', '', 54630),
(249495, 'ruRU', 'Мы так долго служили смерти... Черному Копью нужно равновесие. Надо вернуть старых лоа.', '', 54630),
(249492, 'ruRU', 'Предатели примкнули к опасному лоа. Вы уж сами разберитесь.', '', 54630),
(249491, 'ruRU', '', 'У нас нет ни даров, ни алтарей... но я попробую их призвать.', 54630),
(249490, 'ruRU', '', 'Раньше у племени Черного Копья было много лоа. А теперь мы как будто сами по себе.', 54630),
(249484, 'ruRU', 'Помните Мве\'залу? Лоа, которого я пленил. Кто-то из вас оставляет ему дары. Жертвы и кровь.', '', 54630),
(249476, 'ruRU', 'Давным-давно, когда у Вол\'джина появились вопросы, он обратился к лоа. Мы назвали это Испытанием лоа.', '', 54630),
(249470, 'ruRU', 'Рокхановы помощники здесь?', '', 54630),
(249171, 'ruRU', '', 'Удачи, $p. Если кто и сможет укротить пламя, это ты.', 54630),
(249141, 'ruRU', '', '$ct! Я слышала, тебе пришлось сражаться! Сколько врагов там было? У тебя есть новые шрамы?\n\n<Дионесса гордо распрямляет спину и упирает руки в бока.>\n\nА я защищала сад! Все по твоей науке, $ct!', 54630),
(249139, 'ruRU', '', 'Командир! Я слышала, тебе пришлось сражаться! Как много врагов там было? У тебя теперь новые шрамы?\n\n<Дионесса гордо распрямляет спину и упирает руки в бока.>\n\nА я защищала сад! Все по твоей науке, командир!', 54630),
(249106, 'ruRU', '', 'Мы – его Аспекты.', 54630),
(249105, 'ruRU', '', 'помогут защитить наш мир.', 54630),
(249104, 'ruRU', '', 'горькие и радостные,', 54630),
(249103, 'ruRU', '', 'древние и новые,', 54630),
(249102, 'ruRU', '', 'Все полученные нами уроки,', 54630),
(249101, 'ruRU', '', 'стали семьей.', 54630),
(249100, 'ruRU', '', 'то получили дар от Азерот и наконец', 54630),
(249099, 'ruRU', '', 'Но когда мы объединились во имя высшей цели,', 54630),
(249098, 'ruRU', '', 'Когда титаны даровали нам силу, драконий род раскололся.', 54630),
(249097, 'ruRU', '', 'Все мы.', 54630),
(249096, 'ruRU', 'Возможно, мы и должны держаться вместе.', '', 54630),
(249095, 'ruRU', '', 'И мы это сделали.', 54630),
(249094, 'ruRU', 'Нам просто надо было... собраться вместе.', '', 54630),
(249093, 'ruRU', '', 'Но они никогда не были нашими.', 54630),
(249092, 'ruRU', '', 'вернуть себе силы Аспектов, чтобы выжить.', 54630),
(249091, 'ruRU', '', 'Я думала, нам надо было', 54630),
(249090, 'ruRU', '', 'О, теперь все понятно.', 54630),
(249089, 'ruRU', 'Я это чувствовал... это было... прекрасно.', '', 54630),
(249088, 'ruRU', 'Азерот благословила нас.', '', 54630),
(249087, 'ruRU', '', 'Сейчас...', 54630),
(249086, 'ruRU', '', 'Когда-то Аспекты благословляли Древо Жизни.', 54630),
(249085, 'ruRU', '', 'Амирдрассил оставил Сон.', 54630),
(249084, 'ruRU', '', '...но я такую не знаю.', 54630),
(249083, 'ruRU', '', 'Она из нашего мира...', 54630),
(249082, 'ruRU', 'Нет... это магия не титанов...', '', 54630),
(249081, 'ruRU', 'Наши силы Аспектов... вернулись?', '', 54630),
(249080, 'ruRU', 'Как это возможно?', '', 54630),
(249079, 'ruRU', '', 'Нечто... неожиданное...', 54630),
(249078, 'ruRU', '', 'Алекстраза... что произошло?', 54630),
(248779, 'ruRU', 'Ты хоть представляешь, какое древнее оружие держишь в руках, |3-6($c)?\n\nКогда-то всем нашим миром правила Темная Империя. То было прекрасное время.\n\nСамые верные последователи получали от владык дары. Одним из таких даров был твой посох.\n\nЕго вручили Предвестнице, чтобы однажды она смогла... смогла...\n\nЧто? Нет! Я не собирался ничего рассказывать! Я... я...\n\n<Орк внезапно затихает, будто выслушивая порицания какого-то невидимого существа.>', '', 54630),
(248777, 'ruRU', 'Я говорил, что конец времен уже близок. Твое оружие это доказывает.\n\nОно источает ту же энергию, что и клинок Темного титана.\n\nПочему он нанес удар именно сюда? Вряд ли такой гениальный стратег поразил это место случайно.\n\nОн стремился к уничтожению всего живого. Этот удар – последнее, что Темный титан сделал перед тем, как его заточил Пантеон. Это действие наверняка послужит его цели.\n\nОсторожно, |3-6($c). Ты ведь не хочешь ненароком приблизить его триумф?', '', 54630),
(248249, 'ruRU', '', 'Наши сплюшки обожают гнездиться на высоте или в каких-нибудь труднодоступных местах.', 54630),
(247966, 'ruRU', 'Я одна плету узор. Остальные должны сгинуть.', '', 54630),
(247910, 'ruRU', 'Познайте, что такое истинное пламя!', '', 54630),
(247890, 'ruRU', '', 'Тогда держи посылки. Внутри разные припасы, угощения и материал для гнезд.', 54630),
(247630, 'ruRU', '', 'Ты здесь, чтобы помочь отнести посылки нашим совам? Они свили себе гнезда в самых дальних и высоких уголках.\n\nОбычно я обращаюсь к другим совам, но времена у нас непростые и у всех дел по горло. Я буду очень благодарна тебе за помощь.', 54630),
(247629, 'ruRU', 'Ого! Привет тебе снова!\n\n<Роуи быстро озирается, чтобы убедиться, что никто из взрослых за вами не наблюдает. Затем придвигается поближе и шепчет:>\n\nТы только никому не говори, но мы с Ниило хотим найти приключение! Тогда мы станем великими героями, прямо как ты!\n\nОгрызок тоже идет с нами. У него такие когтищи и зубищи! Пригодятся, когда на нас нападут дикие звери.\n\n<Роуи снова смотрит на взрослых и вздыхает.>\n\nНе волнуйся, мы начнем с чего попроще. С какого-нибудь маленького путешествия. Скажем, в Блестящий залив.', 'Ого! Привет тебе снова!\n\n<Роуи быстро озирается, чтобы убедиться, что никто из взрослых за вами не наблюдает. Затем придвигается поближе и шепчет:>\n\nТы только никому не говори, но мы с Ниило хотим найти приключение! Тогда мы станем великими героями, прямо как ты!\n\nОгрызок тоже идет с нами. У него такие когтищи и зубищи! Пригодятся, когда на нас нападут дикие звери.\n\n<Роуи снова смотрит на взрослых и вздыхает.>\n\nНе волнуйся, мы начнем с чего попроще. С какого-нибудь маленького путешествия. Скажем, в Блестящий залив.', 54630),
(247497, 'ruRU', '', 'Будь аккуратнее, когда встанешь на диск! Смотри под ноги!', 54630),
(247407, 'ruRU', 'Держись, $n. Мы почти запечатали портал!', 'Держись, $n. Мы почти запечатали портал!', 54630),
(247131, 'ruRU', 'Отличная работа. Признаюсь, я бы вряд ли справился.', '', 54630),
(247130, 'ruRU', 'Впечатляет, ничего не скажешь! А теперь иди сюда и покажи топор.', '', 54630),
(247020, 'ruRU', '$n, не пускай к нам элементалей, пока не закроем портал.', '$n, не пускай к нам элементалей, пока не закроем портал.', 54630),
(246768, 'ruRU', '<Главный шеф-повар Измельчатор весь сияет и лупит сковородой по горелке.\n\nВы понимаете, что шеф очень занят, но все же рад вас видеть.>', '', 54630),
(246767, 'ruRU', '<Ученик Таки поднимает глаза от списка.>\n\nА, привет. Не волнуйся, я просто записываю, что проходит через портал. Ну, знаешь, для Кирин-Тора. Им это очень важно.\n\n...Если понравится что-то, дай знать, – и я не внесу это в список. Но тс-с...', '', 54630),
(246750, 'ruRU', 'Острова великолепны. Интересно, куда нас дальше отправит Консорциум ремесленников? Жду не дождусь!', '', 54630),
(246291, 'ruRU', 'В темные времена бывает сложно поверить, что однажды все беды останутся позади и что мы их перерастем. Взгляни на семена. Они тоже растут во мраке земли – и гляди-ка, во что вырастают! Гляди, как красиво они цветут!', '', 54630),
(246211, 'ruRU', '', 'Если он тебя не поблагодарил, это сделаю я. Спасибо.\n\nЕму об этом не сообщай.', 54630),
(244910, 'ruRU', '', 'Как же выносливы эти звери. Так много пережили – но все равно справляются. Это вдохновляет.', 54630),
(244909, 'ruRU', '', 'Бедствие на севере согнало животных с насиженных мест. Проверишь, как они выживают в новых землях?', 54630),
(244904, 'ruRU', '', 'Спасибо тебе. Мы сейчас же их пересадим. Надеемся, со временем Сон исцелится и растения вновь зацветут.', 54630),
(244903, 'ruRU', '', 'Огненный шрам неподалеку серьезно влияет на местную флору. Собери умирающие цветы – мы попробуем их оживить.', 54630),
(244620, 'ruRU', '', 'Отлично! Теперь Источник какое-то время будет в безопасности.', 54630),
(244581, 'ruRU', '', 'Вражеские войска снова собираются с силами. Поставь их на место, пока они не окрепли.', 54630),
(244364, 'ruRU', '', 'Спасибо тебе большое. Здоровье сплюшек показывает, здоров ли наш Сон.', 54630),
(244361, 'ruRU', '', 'Так гораздо лучше. Теперь местные звери и травы смогут отдохнуть.', 54630),
(244337, 'ruRU', '', 'Чужаки принесли с собой огонь, а он привел плеточников и волноногов в бешенство. Защити наши берега.', 54630),
(244336, 'ruRU', '', 'Я собрала все, что может понадобиться сплюшкам.', 54630),
(244238, 'ruRU', '', 'Это было странно. Но зато теперь на берегах вновь царит мир и покой. Спасибо.', 54630),
(244237, 'ruRU', '', 'Вторжение Фиракка нарушило баланс экосистемы. Надо успокоить местных... черепах.', 54630),
(244226, 'ruRU', '', 'Враги окружили рощу К\'онзу. Останови их, пока они там не закрепились.', 54630),
(244057, 'ruRU', '', 'Отличная работа. Нам удалось потеснить врага.', 54630),
(244056, 'ruRU', '', 'Чтобы дать отпор, нам понадобится помощь Древних. Ведите их в битву.', 54630),
(243645, 'ruRU', 'Да неужто это снова ты, $c? Рад видеть! Ну как, удалось найти еще камни Плети?', '', 54630),
(240418, 'ruRU', 'Вот что! Сделай-ка снимок со мной и этой шикарной красной мадамой, а потом я вернусь домой через портал. Лады?', '', 54630),
(240412, 'ruRU', 'Нет-нет, подруга! Ты и так выглядишь потрясающе!', '', 54630);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(240411, 'ruRU', '', 'Может быть, мне принять человеческий облик?', 54630),
(240410, 'ruRU', '<Эрик смотрит на Алекстразу с благоговением.>\n\nТебе когда-нибудь встречалось более прекрасное существо?', '', 54630),
(240309, 'ruRU', '<Олаф не обращает внимания и продолжает танцевать.>', '', 54630),
(239743, 'ruRU', 'Люблю, когда делают так, как я говорю. Хорошая работа.', '', 54630),
(239742, 'ruRU', 'Элементали пламени Тьмы угрожают разнести заразу по всем пещерам. Затопчи их!', '', 54630),
(238872, 'ruRU', 'Нам нужно очистить серную реку. Помоги упокоить этих бедолаг.', '', 54630),
(238871, 'ruRU', 'Отвратительное наследие прошлого. Спасибо. Теперь они обретут покой.', '', 54630),
(238835, 'ruRU', 'Я... сильный...', '', 54630),
(238815, 'ruRU', '', 'Я никогда... не сдамся...', 54630),
(236160, 'ruRU', 'И только? Какие-то гулянки?\n\nА я-то думал, ты предупредишь о новом нашествии Плети, Легиона или еще какой-то колоссальной угрозе!', '', 54630),
(236158, 'ruRU', 'В Альтеракской долине уже несколько лет ничего не происходит.\n\nПочему такие важные гости пожаловали к нам именно сегодня?', '', 54630),
(234730, 'ruRU', 'Аромат смердокорня – один из самых дивных на свете! Наши нюховедчики отметили дорогу к нему. Возьми курильницу и иди по запаху.', '', 54630),
(233732, 'ruRU', 'Значит, все решено. Отправляйся с моими родными в Оргриммар и готовься к обряду. Мы с Эйтриггом тем временем соберем все кланы. Встретимся в Дуротаре.\n\nВот, возьми мой камень возвращения. Он перенесет тебя в \"Сломанный клык\". Скоро увидимся.', '', 54630),
(232961, 'ruRU', 'Звездный капитан Барабос как раз вернулся из путешествия. Он научит тебя... разбойничьим штучкам. \n\nНайдешь его в затененной части Террасы Воинов, которая находится над Торговым Рядом.', 'Звездный капитан Барабос как раз вернулся из путешествия. Он научит тебя... разбойничьим штучкам. \n\nНайдешь его в затененной части Террасы Воинов, которая находится над Торговым Рядом.', 54630),
(232283, 'ruRU', 'Если вождю нужна моя поддержка, он ее получит.', '', 54630),
(230685, 'ruRU', '', 'Интересно, вспомнят ли они нас? И то, что мы сделали?\n\nВидимо, есть лишь один способ проверить...', 54630),
(230646, 'ruRU', 'Хочешь сказать, в ваших краях нет уток?', '', 54630),
(227003, 'ruRU', 'Расплющил!', '', 54630),
(226875, 'ruRU', '', 'Ха! Жалкая добыча.', 54630),
(226796, 'ruRU', 'Я очищу эти залы от нарушителей.', '', 54630),
(225964, 'ruRU', 'Здесь струится могущественная магия, $n.\n\nТебе нужно настроиться на эту энергию. Воспользуйся кристаллами. \n\nПосле этого ты сможешь увидеть больше энергии, которую потребуется собрать, а твоя способность прыгать значительно усилится.', '', 54630),
(225483, 'ruRU', '', 'Возможно, мы узнаем, для чего были нужны эти реликвии. Добавлю их в коллекцию!', 54630),
(225481, 'ruRU', '', 'Тут повсюду древние реликвии титанов. Никогда не упускай возможность исследовать прошлое!', 54630),
(225463, 'ruRU', '', 'Когда мы изучим эту энергию, сможем лучше понять ее природу. Отличная работа, герой.', 54630),
(225460, 'ruRU', '', 'В этих руинах полно силовых линий. Надо собрать как можно больше энергии для исследований.', 54630),
(225260, 'ruRU', '', 'Хорошо. Тебе удалось остановить гноллов. Мы продолжим наблюдать за этим местом. Возможно, тебе снова придется вмешаться.', 54630),
(224658, 'ruRU', '<Заметив вас, выдра принимается жалобно скулить.>', '', 54630),
(223455, 'ruRU', 'Какое... мягкое...', '', 54630),
(223299, 'ruRU', '', 'Спасибо. Мы не забудем о твоей помощи.', 54630),
(222790, 'ruRU', 'Спасибо. Теперь все должно успокоиться, и животные смогут прийти в себя.', '', 54630),
(222789, 'ruRU', 'Элементали буйствуют на болотах. Избавься от них и спаси существ, которым они успели навредить.', '', 54630),
(199435, 'ruRU', 'Что ж, уговор есть уговор.', '', 54630),
(199434, 'ruRU', 'Лорд Скаул кидает сундук с сокровищами на землю.', '', 54630),
(199433, 'ruRU', 'Теперь забирай свое сокровище и оставь меня в покое!', '', 54630),
(199432, 'ruRU', 'Немного в пыли, но, думаю, ничего страшного.', '', 54630),
(199403, 'ruRU', 'Это же Пепельный Предел! Здесь можно найти что угодно.\n\nОсмотрись. Наверняка это где-то рядом. Загляни в другие клетки.', '', 54630),
(199402, 'ruRU', 'Сокровище, ну конечно... Поэтому ты мне докучаешь, не так ли?\n\nЯ предложу тебе тот же уговор, что и другим беспринципным искателям сокровищ: принеси мне книгу и получишь сокровища.\n\nНо предупреждаю, я очень привередливый читатель.', '', 54630);
